INSERT INTO `equip_addon_type` VALUES (1,'HP +pow','最大HPを[power]増加させる。'),(2,'通常攻撃 +pow','攻撃力を[power]増加させる。'),(3,'通常防御 +pow','防御力を[power]増加させる。'),(4,'特殊攻撃 +pow','特殊攻撃力を[power]増加させる。'),(5,'特殊防御 +pow','特殊防御力を[power]増加させる。'),(6,'クリティカル率 +pow%','クリティカル発生率を[power]％増加させる。'),(7,'オートガード率 +pow%','オートガード発生率を[power]％増加させる。'),(8,'スキル回復倍率 +pow%','スキルゲージ増加量を[power]％増加させる。'),(9,'剣霊ゲージ増加率 +pow%','召喚ゲージ増加量を[power]％増加させる。'),(10,'麻痺攻撃率 +pow%','攻撃HIT時、[power]％の確率でマヒ状態にする。'),(11,'毒攻撃率 +pow%','攻撃HIT時、[power]％の確率で毒状態にする。'),(12,'属性攻撃率 +pow%','(未使用)'),(13,'麻痺耐性率 +pow%','プレイヤーがマヒ状態になる確率を[power]％減少させる。'),(14,'毒耐性率 +pow%','プレイヤーが毒状態になる確率を[power]％減少させる。'),(15,'属性防御 +pow%','(未使用)'),(16,'混乱防御（未使用）','(未使用)'),(17,'怒り防御（未使用）','(未使用)'),(18,'虚弱防御（未使用）','(未使用)'),(19,'撃破時HP吸収量 +pow','攻撃・スキルHIT時、HPが[power]回復する。'),(20,'火魔法発動 +pow%','攻撃した時、[power]％の確率で「ファイアーボール」の魔法が発動する。'),(21,'水魔法発動 +pow%','攻撃した時、[power]％の確率で「スプラッシュ」の魔法が発動する。'),(22,'風魔法発動 +pow%','攻撃した時、[power]％の確率で「ストーム」の魔法が発動する。'),(23,'光魔法発動 +pow%','攻撃した時、[power]％の確率で「シャイニング」の魔法が発動する。'),(24,'闇魔法発動 +pow%','攻撃した時、[power]％の確率で「カースボール」の魔法が発動する。'),(25,'被ダメ時硬化 +pow%','ダメージを受けた時、[power]％の確率で「ディフェンスブースト」と「レジストブースト」の魔法が発動する。'),(26,'ポーション回復量 +pow','回復系ポーションを使用した時、HP回復量が[power]増加する。'),(27,'即死回避 +pow回','プレイヤーが死亡するダメージを受けた時、[power]回だけHPが１残る。'),(28,'クリティカル威力 +pow','クリティカルヒットした時、ダメージを[power]増加させる。'),(29,'バフ時間 +pow秒','ブースト系スキルを使用した時、効果時間を[power]秒延長する。'),(30,'ヒール回復量 +pow','「ヒール」の魔法を使用した時、HP回復量が[power]増加する。'),(31,'剣威力増加 +pow','プレイヤーが両手剣を装備していた場合、攻撃力と特殊攻撃力を[power]増加させる。'),(32,'槌威力増加 +pow','プレイヤーがハンマーを装備していた場合、攻撃力と特殊攻撃力を[power]増加させる。'),(33,'杖威力増加 +pow','プレイヤーが杖を装備していた場合、攻撃力と特殊攻撃力を[power]増加させる。'),(34,'全状態異常耐性 +pow%','プレイヤーが状態異常になる確率を[power]％減少させる。'),(35,'火属性モンスターへのダメージ増加 +pow%','火属性モンスターへのダメージを[power]％増加させる。'),(36,'水属性モンスターへのダメージ増加 +pow%','水属性モンスターへのダメージを[power]％増加させる。'),(37,'風属性モンスターへのダメージ増加 +pow%','風属性モンスターへのダメージを[power]％増加させる。'),(38,'光属性モンスターへのダメージ増加 +pow%','光属性モンスターへのダメージを[power]％増加させる。'),(39,'闇属性モンスターへのダメージ増加 +pow%','闇属性モンスターへのダメージを[power]％増加させる。'),(40,'無属性モンスターへのダメージ増加 +pow%','無属性モンスターへのダメージを[power]％増加させる。'),(41,'火属性ダメージ軽減 +pow%','火属性ダメージを受けた時、[power]％減少させる。'),(42,'水属性ダメージ軽減 +pow%','水属性ダメージを受けた時、[power]％減少させる。'),(43,'風属性ダメージ軽減 +pow%','風属性ダメージを受けた時、[power]％減少させる。'),(44,'光属性ダメージ軽減 +pow%','光属性ダメージを受けた時、[power]％減少させる。'),(45,'闇属性ダメージ軽減 +pow%','闇属性ダメージを受けた時、[power]％減少させる。'),(46,'無属性ダメージ軽減 +pow%','無属性ダメージを受けた時、[power]％減少させる。');
