DROP TABLE IF EXISTS `equip_data`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `equip_data` (
  `std_id` int(10) unsigned NOT NULL,
  `name` varchar(255) DEFAULT NULL,
  `series` int(10) unsigned NOT NULL DEFAULT '0',
  `info` varchar(255) DEFAULT NULL,
  `get_text` varchar(255) DEFAULT NULL,
  `gender` tinyint(4) NOT NULL DEFAULT '2' COMMENT '2:共用\n0:男専\n1:女専',
  `atk` int(11) DEFAULT '0',
  `def` int(11) DEFAULT '0',
  `matk` int(11) DEFAULT '0',
  `mdef` int(11) DEFAULT '0',
  `atk_speed` float DEFAULT '1',
  `move_speed` float DEFAULT '1',
  `fall` float DEFAULT NULL,
  `job` varchar(45) DEFAULT NULL,
  `critical` float DEFAULT NULL,
  `critical_val` float DEFAULT NULL,
  `shield` float DEFAULT NULL,
  `shield_val` float DEFAULT NULL,
  `anim_common` int(11) DEFAULT NULL,
  `anim_model` varchar(255) DEFAULT NULL,
  `attribute` tinyint(3) unsigned DEFAULT NULL,
  `grow_type` int(10) unsigned DEFAULT NULL,
  `cost` smallint(6) DEFAULT '0',
  `train_exp` int(10) unsigned DEFAULT NULL,
  `evo_max` tinyint(4) NOT NULL DEFAULT '0',
  `evo0_maxlv` int(10) unsigned NOT NULL DEFAULT '100',
  `evo1_maxlv` int(10) unsigned NOT NULL DEFAULT '100',
  `evo1_static_bonus_atk` int(10) unsigned NOT NULL DEFAULT '0',
  `evo1_static_bonus_def` int(10) unsigned NOT NULL DEFAULT '0',
  `evo1_static_bonus_matk` int(10) unsigned NOT NULL DEFAULT '0',
  `evo1_static_bonus_mdef` int(10) unsigned NOT NULL DEFAULT '0',
  `evo2_maxlv` int(10) unsigned NOT NULL DEFAULT '100',
  `evo2_static_bonus_atk` int(10) unsigned NOT NULL DEFAULT '0',
  `evo2_static_bonus_def` int(10) unsigned NOT NULL DEFAULT '0',
  `evo2_static_bonus_matk` int(10) unsigned NOT NULL DEFAULT '0',
  `evo2_static_bonus_mdef` int(10) unsigned NOT NULL DEFAULT '0',
  `evo3_maxlv` int(10) unsigned NOT NULL DEFAULT '100',
  `evo3_static_bonus_atk` int(10) unsigned NOT NULL DEFAULT '0',
  `evo3_static_bonus_def` int(10) unsigned NOT NULL DEFAULT '0',
  `evo3_static_bonus_matk` int(10) unsigned NOT NULL DEFAULT '0',
  `evo3_static_bonus_mdef` int(10) unsigned NOT NULL DEFAULT '0',
  `addon` varchar(255) DEFAULT NULL,
  `skill1` varchar(255) DEFAULT NULL,
  `skill2` varchar(255) DEFAULT NULL,
  `techniq` int(11) DEFAULT NULL,
  `teq_effect` int(10) unsigned DEFAULT NULL,
  `rarity` int(10) unsigned DEFAULT NULL,
  `sell` int(11) DEFAULT NULL,
  `model_m` varchar(255) DEFAULT NULL,
  `texture_m` varchar(255) DEFAULT NULL,
  `model_w` varchar(255) DEFAULT NULL,
  `texture_w` varchar(255) DEFAULT NULL,
  `model_flag` int(10) unsigned NOT NULL DEFAULT '0',
  `cloth_bone` int(10) unsigned NOT NULL DEFAULT '4',
  `cv` varchar(16) DEFAULT '',
  `illustrator` varchar(16) DEFAULT '',
  `specialized_dun` varchar(255) DEFAULT NULL,
  `specialized_rate` float DEFAULT '1',
  `rare_spirit` tinyint(4) DEFAULT '0',
  PRIMARY KEY (`std_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;
/*!40101 SET character_set_client = @saved_cs_client */;

