INSERT INTO `equip_data` VALUES (300001,'オルフェ',0,'王の家臣。幼いころから活発で、好奇心も旺盛ないたずらっ子であった。10代で王の護衛として行動を共にすることも多く、戦いにも積極的に参加し、常に王を助ける精神と勇猛さを発揮した','やっほー。オルフェだよー。',2,57,0,83,0,1.9,0.85,0,'ファイター',0.05,0.5,0,0,1,'anm_m_rsw0',6,8,8,890,3,40,50,1,0,2,0,60,3,0,4,0,70,3,0,5,0,'0:100','402006:100','0:100',450401,518,3,200,'swd001_a00','swd001_a00_0',NULL,NULL,0,0,'相沢舞','薫唯',NULL,1,5),(300002,'ホック',590004,'物怖じしない性格でどんな相手にも恐れずに勇士として活躍。各地を旅し、20代でドラゴンとの死闘を繰り広げる。娘のムータが産まれた後、故郷を救うため再びドラゴン退治に赴いた','俺はホックだ。よろしく頼むぞ！',2,69,0,98,0,1.9,0.85,0,'ファイター',0.05,0.5,0,0,1,'anm_m_rsw0',6,8,11,905,3,40,50,2,0,2,0,60,3,0,4,0,70,4,0,5,0,'0:100','402006:100','401101:25,401102:25,401103:25,401202:25',450401,518,3,200,'swd001_a00','swd001_a00_1',NULL,NULL,0,0,'中井和哉','syoujin','0',1,5),(300003,'オサック',0,'内気な少女。泣くと周りの耳を破壊しかねないほどの大音量で鳴き、水たまりができるほど涙を流す。それゆえ、周りは彼女を泣かせないように必死に気を遣っている','ひぐっ、オサックです。よろしくお願いします。くすん。',2,76,0,107,0,1.9,0.85,0,'ファイター',0.05,0.5,0,0,1,'anm_m_rsw0',6,8,13,915,3,40,50,2,0,3,0,60,3,0,5,0,70,4,0,6,0,'0:100','402006:100','0:100',450401,518,3,200,'swd001_a00','swd001_a00_2',NULL,NULL,0,0,'相沢舞','新谷真昼','0',1,5),(300004,'プセラ',590010,'多くの人の前では話せない極度のあがり性。しかし、いざというときには勇気を出して人を助けたり、辛抱強く我慢できる根性を持っている','プセラです。よ、よろしく…',2,68,0,92,0,1.9,0.85,0,'ファイター',0.05,0.5,0,0,1,'anm_m_rsw0',6,8,11,905,3,40,50,2,0,2,0,60,3,0,4,0,70,4,0,5,0,'0:100','402012:100','401102:25,401104:25,401202:25,401204:25',450401,518,3,200,'swd002_a00','swd002_a00_1',NULL,NULL,0,0,'桑島法子','マボ','0',1,5),(300005,'トレニア',590001,'控えめでおとなしく、温和な女の子。しかし、頭はとても冴えており、閃いた考えはとても有用である。一生懸命勉強して、将来は世界一頭が良い人になりたいらしい','トレニアといいます。よろしくお願いします。てへっ',2,63,0,82,0,1.9,0.85,0,'ファイター',0.05,0.5,0,0,1,'anm_m_rsw0',6,8,9,895,3,40,50,2,0,2,0,60,3,0,4,0,70,4,0,5,0,'0:100','402030:100','401101:100',451901,518,3,200,'swd002_a00','swd002_a00_2',NULL,NULL,0,0,'桑島法子','新堂アラタ','0',1,5),(300006,'ファレーノ',0,'ややわがままなところがあるが、各地で従者としてよく活躍し、数々の国や騎士団を勝利へと導いた。小柄な体型を気にしている','ファレーノよ。よろしくね。',2,72,0,111,0,1.9,0.85,0,'ファイター',0.05,0.5,0,0,1,'anm_m_rsw0',6,8,13,915,3,40,50,2,0,3,0,60,3,0,5,0,70,4,0,6,0,'0:100','402006:100','0:100',450401,518,3,200,'swd002_a00','swd002_a00_3',NULL,NULL,0,0,'伊藤かな恵','さんにゃ','0',1,5),(300007,'ドロン',0,'正義感が強く、悪を許さない性格。幼馴染のロードと共に騎士団に入る。騎士団の中でも活躍は顕著で、チームワークを発揮して数々の敵を倒した','俺はドロン！よろしくな！',2,71,0,112,0,1.9,0.85,0,'ファイター',0.05,0.5,0,0,1,'anm_m_rsw0',1,8,13,915,3,40,50,2,0,3,0,60,3,0,5,0,70,4,0,6,0,'0:100','402001:100','401101:25,401102:25,401103:25,401202:25',450401,493,3,200,'swd007_a01','swd007_a01_1',NULL,NULL,0,0,'中井和哉','慎悟','0',1,5),(300008,'サクラ',590004,'頭脳明晰で美人。一見大人のお姉様の印象を受けるが、人に淡泊で冷たく、笑顔がどこか嘘くさい。家はお菓子屋で「ＤＡＩFＵＫＵ」というものを売っており、怒るとそれを投げつけてくる','サクラです。何卒よろしくお願い致します。',2,58,0,86,0,1.9,0.85,0,'ファイター',0.05,0.5,0,0,1,'anm_m_rsw0',1,8,8,890,3,40,50,1,0,2,0,60,3,0,4,0,70,3,0,5,0,'0:100','402001:100','401102:100',452001,493,3,200,'swd001_a01','swd001_a01_1',NULL,NULL,0,0,'斎藤千和','新谷真昼','0',1,5),(300009,'センカ',590004,'貧しい家に生まれた、無邪気な少女。男の子が欲しかった家族は、彼女に男の子として振る舞うようにしつけた。人なつっこい性格で、すぐに人と打ち解けることができる','センカだよ。にゃははー。',2,61,0,102,0,1.9,0.85,0,'ファイター',0.05,0.5,0,0,1,'anm_m_rsw0',1,8,11,905,3,40,50,1,0,3,0,60,3,0,5,0,70,3,0,6,0,'0:100','402007:100','401101:25,401104:25,401103:25,401204:25',451901,493,3,200,'swd002_a01','swd002_a01_1',NULL,NULL,0,0,'照井春佳','Nunohito','0',1,5),(300010,'サリー',590029,'愛想がなく、素っ気ない性格。嫌いなものをハッキリ言うため、友達も少ない。素直になれない性格で、よく兄のゼアスを適当にあしらっているが、本当はとても大切に思っている','サリーよ。なんかよう？',2,63,0,108,0,1.9,0.85,0,'ファイター',0.05,0.5,0,0,1,'anm_m_rsw0',2,8,12,910,3,40,50,1,0,3,0,60,3,0,5,0,70,3,0,6,0,'0:100','402002:100','401101:25,401104:25,401103:25,401204:25',450301,498,3,200,'swd007_a01','swd007_a01_2',NULL,NULL,0,0,'斎藤千和','yurinko','0',1,5),(300011,'ツローズ',590010,'詩を詠み書きする才能があり、発言もポエム調。昔戦いで大怪我をしたが、一命をとりとめて奇跡の復活を果たした。その時の大きな傷は今でも残っている','出会いこそが運命。ツローズです。',2,67,0,100,0,1.9,0.85,0,'ファイター',0.05,0.5,0,0,1,'anm_m_rsw0',2,8,11,905,3,40,50,2,0,3,0,60,3,0,5,0,70,4,0,6,0,'0:100','402026:100','401101:25,401102:25,401103:25,401202:25',451601,498,3,200,'swd001_a01','swd001_a01_2',NULL,NULL,0,0,'相沢舞','石商','0',1,5),(300012,'セロシア',590061,'自称おしゃれさん。しかしセンスが逸脱しており、おしゃれを通り越して風変りとも言える。感情的なため周りからは厄介がられる節がある。走ることが好きで大地をすこぶる愛している','セロシアだ。僕がオシャレすぎて言葉も出ないって感じかな？',2,65,0,95,0,1.9,0.85,0,'ファイター',0.05,0.5,0,0,1,'anm_m_rsw0',2,8,11,905,3,40,50,1,0,2,0,60,3,0,4,0,70,3,0,5,0,'0:100','402008:100','401102:25,401104:25,401202:25,401204:25',450301,498,3,200,'swd002_a01','swd002_a01_2',NULL,NULL,0,0,'中井和哉','秋浪','0',1,5),(300013,'ツバギク',590029,'東洋の剣士。ふらふらと世界を遍歴する流浪の人。 非常に怠け者であり、面倒事は嫌って関わり合いになろうとしなかったが、ひとたび剣を取れば無類の強さを誇った','拙者の名はツバギク。よろしくお願い致す。',2,69,0,98,0,1.9,0.85,0,'ファイター',0.05,0.5,0,0,1,'anm_m_rsw0',3,8,11,905,3,40,50,2,0,2,0,60,3,0,4,0,70,4,0,5,0,'0:100','402003:100','401102:25,401104:25,401103:25,401202:25',450301,503,3,200,'swd007_a01','swd007_a01_3',NULL,NULL,0,0,'中井和哉','兎鷺','0',1,5),(300014,'ラビータ',0,'「弱きを助け、強気をくじく」をモットーにしている。騎士団に入り最前線で戦っていた。幼馴染のフローテと深く信頼し合っており、周りからも親密な友愛を感じさせると評されている','ラビータだ。よろしくな。',2,75,0,105,0,1.9,0.85,0,'ファイター',0.05,0.5,0,0,1,'anm_m_rsw0',3,8,12,910,3,40,50,2,0,3,0,60,3,0,5,0,70,4,0,6,0,'0:100','402027:100','401101:25,401104:25,401103:25,401204:25',452201,503,3,200,'swd001_a01','swd001_a01_3',NULL,NULL,0,0,'井上喜久子','ゴンザレスロッキー','0',1,5),(300015,'ビガータ',590010,'雄弁で決断力がある。サバサバしてる性格で、女の子にモテる。「持っていると幸せになる」という珍しいアイテムを買ってきては、人にそれを贈りたがる変な趣味の持ち主','ビガータっていいます！マスターもこれ、いります？',2,68,0,92,0,1.9,0.85,0,'ファイター',0.05,0.5,0,0,1,'anm_m_rsw0',3,8,11,905,3,40,50,2,0,2,0,60,3,0,4,0,70,4,0,5,0,'0:100','402009:100','401101:25,401102:25,401202:25,401204:25',450401,503,3,200,'swd002_a01','swd002_a01_3',NULL,NULL,0,0,'桑島法子','ミツロ','0',1,5),(300016,'ウユリ',0,'純白の鎧に身を包んだ聖騎士。ある国の騎士団長として常に陣頭指揮を執り、正義に燃える女戦士であった。 威厳ある風貌と男勝りな血気を併せ持ち、数多くの民から羨望と名声を集めた','聖騎士団々長、ウユリ！よろしくお願い致します！',2,75,0,100,0,1.9,0.85,0,'ファイター',0.05,0.5,0,0,1,'anm_m_rsw0',4,8,12,910,3,40,50,2,0,3,0,60,3,0,5,0,70,4,0,6,0,'0:100','402004:100','401101:25,401102:25,401103:25,401202:25',451501,508,3,200,'swd007_a01','swd007_a01_4',NULL,NULL,0,0,'桑島法子','さんにゃ','0',1,5),(300017,'ルイメ',0,'生前は神に仕える仕事をしていたが、妖（アヤカシ）の類いは見えなかった。察知できるのは気配のみなので、「見えないもの」への恐怖は強いようである。思いつきで行動する直感型','ルイメです。よろしくお願いします。',2,67,0,104,0,1.9,0.85,0,'ファイター',0.05,0.5,0,0,1,'anm_m_rsw0',4,8,12,910,3,40,50,2,0,3,0,60,3,0,5,0,70,4,0,6,0,'0:100','402028:100','401102:25,401104:25,401202:25,401204:25',450401,508,3,200,'swd001_a01','swd001_a01_4',NULL,NULL,0,0,'大空直美','ウスダヒロ','0',1,5),(300018,'イナフィア',590004,'人を楽しませることが大好きなサーカス団の一員。お客さんが笑ってくれることが生きがい。生まれた時から育ったサーカス団の中で、恋をしてしまい、仕事と恋愛でジレンマを抱えていた','イッナフィッアでーすっ！',2,62,0,98,0,1.9,0.85,0,'ファイター',0.05,0.5,0,0,1,'anm_m_rsw0',4,8,11,905,3,40,50,1,0,2,0,60,3,0,4,0,70,3,0,5,0,'0:100','402010:100','401101:25,401104:25,401103:25,401204:25',451601,508,3,200,'swd002_a01','swd002_a01_4',NULL,NULL,0,0,'吉村那奈美','Miki/GateAsia','0',1,5),(300019,'ホーソン',590004,'槍投げの腕がピカイチのスポーツマン。成功を掴むために努力をするタイプではなく、成功を待つタイプ。少々短気なところもある。すぐ相手に対抗心を燃やしてライバル視する','ホーソンというぞ！よろしく！',2,55,0,90,0,1.9,0.85,0,'ファイター',0.05,0.5,0,0,1,'anm_m_rsw0',5,8,9,895,3,40,50,1,0,2,0,60,2,0,4,0,70,3,0,5,0,'0:100','402005:100','401103:100',450401,513,3,200,'swd007_a01','swd007_a01_5',NULL,NULL,0,0,'関智一','syoujin','0',1,5),(300020,'ダリア',0,'一見優雅な女性に見えるが、とても情緒不安定。落ち着いたかと思えば急に泣き出したり、怒ったりする。優柔不断で、口癖は「どうしよう」。いつもおろおろしていて、被害妄想癖がある','どうしよう…あ、ダリアです。よろしく。',2,68,0,112,0,1.9,0.85,0,'ファイター',0.05,0.5,0,0,1,'anm_m_rsw0',5,8,12,910,3,40,50,2,0,3,0,60,3,0,5,0,70,4,0,6,0,'0:100','402029:100','401101:25,401102:25,401103:25,401202:25',452401,513,3,200,'swd001_a01','swd001_a01_5',NULL,NULL,0,0,'大空直美','仲原','0',1,5),(300021,'ミーア',0,'感受性が豊かで表情がコロコロ変わる。喫茶店を営んでいた。柔軟なものの考え方をしており、何事にも臨機応変に対応できる','いらっしゃ・・・じゃなかった、はじめまして、ミーアです。',2,63,0,108,0,1.9,0.85,0,'ファイター',0.05,0.5,0,0,1,'anm_m_rsw0',5,8,12,910,3,40,50,1,0,3,0,60,3,0,5,0,70,3,0,6,0,'0:100','402011:100','401102:25,401104:25,401202:25,401204:25',450301,513,3,200,'swd002_a01','swd002_a01_5',NULL,NULL,0,0,'桑島法子','央助','0',1,5),(300022,'ピアナ',590004,'戦いで多くの仲間を失った剣士。絶望的な状況でも常に仲間を励まし続け、前に進む熱意をもっている。忠実で、理不尽なことは許せない性格であるが、ちょっと頑固なところもある','ピアナっていうの。よろしくね。',2,63,0,92,0,1.9,0.85,0,'ファイター',0.05,0.5,0,0,1,'anm_m_rsw0',1,8,10,900,3,40,50,1,0,2,0,60,3,0,4,0,70,3,0,5,0,'0:100','402001:100','401102:25,401104:25,401103:25,401202:25',450401,493,3,200,'swd004_a01','swd004_a01_1',NULL,NULL,0,0,'桑島法子','十重','0',1,5),(300023,'マルムフ',0,'生真面目な性格。恋占いが得意で、町の一角で占い屋をやっていた。的中率が高いので彼のもとには男女問わず色んな人が占いを求めてやってきた。彼自身にも心に想う人がいるようだ','恋占い師のマルムフだ。よろしく。',2,75,0,108,0,1.9,0.85,0,'ファイター',0.05,0.5,0,0,1,'anm_m_rsw0',1,8,13,915,3,40,50,2,0,3,0,60,3,0,5,0,70,4,0,6,0,'0:100','402025:100','401101:25,401104:25,401103:25,401204:25',451601,493,3,200,'swd008_a01','swd008_a01_1',NULL,NULL,0,0,'関智一','まっつん！','0',1,5),(300024,'アリラ',590067,'幼い頃に実家と家族を争いにより失った。そのため全ての武器に恐怖を抱き、武器を見ると怯えてしまう。争いの真相を知り、復讐したいという強い怨念でフォルティスになった','アリラです。私の復讐に協力してもらうわ。',2,71,0,100,0,1.9,0.85,0,'ファイター',0.05,0.5,0,0,1,'anm_m_rsw0',1,8,12,910,3,40,50,2,0,3,0,60,3,0,5,0,70,4,0,6,0,'0:100','402007:100','401101:25,401102:25,401202:25,401204:25',451901,493,3,200,'swd003_a00','swd003_a00_1',NULL,NULL,0,0,'桑島法子','彪河なり','0',1,5),(300025,'ベーラ',0,'この世のあらゆる「美容」に関わることを実践し、究極の美を手にいれた。美に対しては貪欲で永遠に美しくありたいと思っている。そのためにはどんな手段もいとわず、痛みや苦しみにも耐えてきた','うちはベーラいいます。うち、えらいうつくしいでしょ？',2,77,0,106,0,1.9,0.85,0,'ファイター',0.05,0.5,0,0,1,'anm_m_rsw0',2,8,13,915,3,40,50,2,0,3,0,60,3,0,5,0,70,4,0,6,0,'0:100','402002:100','401101:25,401102:25,401103:25,401204:25',451901,498,3,200,'swd004_a01','swd004_a01_2',NULL,NULL,0,0,'相沢舞','十重','0',1,5),(300026,'モンディ',590029,'温和な性格で協調性があり、何かを頼まれると断れない。自分の力量を考えずになんでも引き受けてしまうので、時々対応できず相手も困らせてしまう','はいはーい。モンディだよぉ↑',2,67,0,88,0,1.9,0.85,0,'ファイター',0.05,0.5,0,0,1,'anm_m_rsw0',2,8,10,900,3,40,50,2,0,2,0,60,3,0,4,0,70,4,0,5,0,'0:100','402026:100','401202:100',451601,498,3,200,'swd008_a01','swd008_a01_2',NULL,NULL,0,0,'平野文','路地子','0',1,5),(300027,'ヒストラム',0,'自分はすばらしく、美しいという自尊心が強いナルシスト。おしゃべりで、気取っているところがある。いずれ王になるという野望があるが、家臣どまりでその見込みはない','僕の名前がそんなに知りたい？ふふ、ヒストラムだよ。',2,72,0,111,0,1.9,0.85,0,'ファイター',0.05,0.5,0,0,1,'anm_m_rsw0',2,8,13,915,3,40,50,2,0,3,0,60,3,0,5,0,70,4,0,6,0,'0:100','402008:100','401101:25,401104:25,401202:25,401204:25',452101,498,3,200,'swd003_a00','swd003_a00_2',NULL,NULL,0,0,'赤羽根健治','秋浪','0',1,5),(300028,'ジムナステル',0,'女性に対して極度に優しい態度を取り、世界中に彼女を作って回っているプレイボーイ。その開放的な行動とは裏腹に非常に繊細な一面を持ち、自らの心が傷つくことを非常に恐れている','ジムナステルっていうのさ。よろしくね。',2,71,0,112,0,1.9,0.85,0,'ファイター',0.05,0.5,0,0,1,'anm_m_rsw0',3,8,13,915,3,40,50,2,0,3,0,60,3,0,5,0,70,4,0,6,0,'0:100','402003:100','401101:25,401104:25,401103:25,401202:25',451901,503,3,200,'swd004_a01','swd004_a01_3',NULL,NULL,0,0,'中井和哉','ウスダヒロ','0',1,5),(300029,'リア',0,'急に態度が変わる気まぐれ屋。親が長い旅に出ていってしまう際に作ってくれた人形が大好きで、いつも持っている','あはっ。リアだよぅ。',2,70,0,113,0,1.9,0.85,0,'ファイター',0.05,0.5,0,0,1,'anm_m_rsw0',3,8,13,915,3,40,50,2,0,3,0,60,3,0,5,0,70,4,0,6,0,'0:100','402027:100','401101:25,401102:25,401103:25,401204:25',450401,503,3,200,'swd008_a01','swd008_a01_3',NULL,NULL,0,0,'久川綾','路地子','0',1,5),(300030,'ジニア',0,'遠くへ行ってしまった友達のことが忘れられない。フォルティスになって以降も、いつかまた会えることを楽しみにしている。注意力が散漫で、人に注意をされることも多い','ジニアで～す。幸せいっぱいがんばるよー。',2,69,0,114,0,1.9,0.85,0,'ファイター',0.05,0.5,0,0,1,'anm_m_rsw0',3,8,13,915,3,40,50,2,0,3,0,60,3,0,5,0,70,4,0,6,0,'0:100','402009:100','401102:25,401104:25,401202:25,401204:25',450401,503,3,200,'swd003_a00','swd003_a00_3',NULL,NULL,0,0,'伊藤かな恵','п猫Ｒ','0',1,5),(300031,'タレハ',0,'他人の幸福のために剣を取る優しき兵士。自らのためでなく、誰かのために戦う時、その力を何倍にもして発揮することができる精鋭。家庭においてはおしどり夫婦として知られていた','タレハだ。俺が守ってやる。',2,68,0,115,0,1.9,0.85,0,'ファイター',0.05,0.5,0,0,1,'anm_m_rsw0',4,8,13,915,3,40,50,2,0,3,0,60,3,0,5,0,70,4,0,6,0,'0:100','402004:100','401102:25,401104:25,401103:25,401202:25',451601,508,3,200,'swd004_a01','swd004_a01_4',NULL,NULL,0,0,'小野坂昌也','ENIGMAX?','0',1,5),(300032,'エイク',0,'まるっぽい体つきで女の子に近い見た目をしている男の子。ある女の子に恋をしていて、その子を見るたびに揺れる心をどうしようか悩んでいる','僕はエイク。一緒に頑張りましょう！',2,73,0,110,0,1.9,0.85,0,'ファイター',0.05,0.5,0,0,1,'anm_m_rsw0',4,8,13,915,3,40,50,2,0,3,0,60,3,0,5,0,70,4,0,6,0,'0:100','402028:100','401101:25,401104:25,401202:25,401204:25',450401,508,3,200,'swd008_a01','swd008_a01_4',NULL,NULL,0,0,'朴?美','マボ','0',1,5),(300033,'ムルマ',590013,'笑顔が特徴的で可憐な女の子。か弱く見られがちだが、苦しい時も笑顔で頑張ることができ、周りもそれにつられて笑顔になる。幼い頃から外で遊ぶのが好きで野原を走り回ってよく怪我をした','初めまして、わたしムルマ。',2,59,0,86,0,1.9,0.85,0,'ファイター',0.05,0.5,0,0,1,'anm_m_rsw0',4,8,9,895,3,40,50,1,0,2,0,60,3,0,4,0,70,3,0,5,0,'0:100','402010:100','401102:100',450301,508,3,200,'swd003_a00','swd003_a00_4',NULL,NULL,0,0,'伊藤かな恵','たいちょ','0',1,5),(300034,'サウルルス',590004,'医者でありながら「苦しませないことが患者への優しさ」とし、安楽死を積極的に行う。延命措置を行う者を「生死の秩序を乱す」として許さない。宗教的な狂気を秘める','サウルルス、と言います。死ぬときは私にお声掛けを…',2,66,0,94,0,1.9,0.85,0,'ファイター',0.05,0.5,0,0,1,'anm_m_rsw0',5,8,11,905,3,40,50,1,0,2,0,60,3,0,4,0,70,3,0,5,0,'0:100','402005:100','401101:25,401102:25,401103:25,401202:25',450401,513,3,200,'swd004_a01','swd004_a01_5',NULL,NULL,0,0,'関智一','新谷真昼','0',1,5),(300035,'テクス',0,'主に忠誠を誓い、命令があればどんなに理不尽なことでもやり通す。いかなる時も心は折れず、死ぬまで主に付き従った。そのためか、何事にも命をかけることに執着する','テクス…です。この命、好きなように使ってください。',2,71,0,100,0,1.9,0.85,0,'ファイター',0.05,0.5,0,0,1,'anm_m_rsw0',5,8,12,910,3,40,50,2,0,3,0,60,3,0,5,0,70,4,0,6,0,'0:100','402029:100','401102:25,401104:25,401103:25,401204:25',450201,513,3,200,'swd008_a01','swd008_a01_5',NULL,NULL,0,0,'平野文','伊藤一磨','0',1,5),(300036,'ポニカ',590028,'性別や年上年下の別なくフレンドリーで敬語は使わない。未来から来たと言って聞かなく、これから先に起こることを予言するが誰にも信じてもらえないので、常にもどかしさを感じている','ポニカよ。未来から来たの。なによ。信じてなさそうな顔ね。',2,66,0,89,0,1.9,0.85,0,'ファイター',0.05,0.5,0,0,1,'anm_m_rsw0',5,8,10,900,3,40,50,1,0,2,0,60,3,0,4,0,70,3,0,5,0,'0:100','402011:100','401101:25,401104:25,401202:25,401204:25',450401,513,3,200,'swd003_a00','swd003_a00_5',NULL,NULL,0,0,'皆口裕子','裕龍ながれ','0',1,5),(300037,'スティバム',590029,'純潔で揺るがない高貴な精神を持った騎士。自分の仕事や生き方に誇りを持っている。慈愛に満ちており、深い愛情で弱き者に接した。口調は男らしく、恋すら知らない乙女','スティバムだ。これからよろしく頼むぞ。',2,105,0,145,0,1.9,0.85,0,'ファイター',0.05,0.5,0,0,1,'anm_m_rsw0',1,11,15,1775,3,50,60,3,0,4,0,70,5,0,7,0,80,6,0,8,0,'0:100','402001:100','402013:30,402019:30,401101:20,401103:20',450402,494,4,1000,'swd005_a00','swd005_a00_1',NULL,NULL,0,0,'久川綾','しおぼい','0',1,15),(300038,'ルコラ',0,'料理が得意な家庭的な女の子。農作業も得意で、野菜などを育てて暮らしていたため、幼い頃から土や植物に触れる機会が多かった。なんでも料理に例えようとする癖がタマにキズ','うふふ・・・。ルコラっていいます。',2,113,0,172,0,1.9,0.85,0,'ファイター',0.05,0.5,0,0,1,'anm_m_rsw0',1,11,17,1785,3,50,60,3,0,5,0,70,5,0,8,0,80,6,0,10,0,'0:100','402007:100','402031:30,402043:30,401102:20,401202:20',450202,495,4,1000,'swd014_a01','swd014_a01_1',NULL,NULL,0,0,'三森すずこ','八重樫南','0',1,15),(300039,'ペクタ',0,'流れに身を任せるタイプで、自分という芯があまりない。口癖は「なんでもいい」「どうでもいい」という怠惰な性格で、みんながいいならそれでいいという振る舞いをする。恋をしては失恋の繰り返し','ペクタ…はぁ、よろしく…',2,114,0,176,0,1.9,0.85,0,'ファイター',0.05,0.5,0,0,1,'anm_m_rsw0',1,11,18,1790,3,50,60,3,0,5,0,70,5,0,8,0,80,6,0,10,0,'0:100','402037:100','402013:30,402067:30,401104:20,401204:20',450102,494,4,1000,'swd013_a00','swd013_a00_1',NULL,NULL,0,0,'朴?美','ちんちら','0',1,15),(300040,'フローテ',0,'ゆるふわ天然系女子。幼いからお嬢様として育てられた。ちょっと世間知らずなところもあるが、持ち前の明るさと笑顔で憎まれることはない。恥ずかしがり屋で、争いは好まない','フローテです。お役にたてるよう頑張ります。',2,111,0,174,0,1.9,0.85,0,'ファイター',0.05,0.5,0,0,1,'anm_m_rsw0',2,11,17,1785,3,50,60,3,0,5,0,70,5,0,8,0,80,6,0,10,0,'0:100','402038:100','402014:30,402032:30,401102:20,401103:20',452102,500,4,1000,'swd010_a01','swd010_a01_2',NULL,NULL,0,0,'照井春佳','竹森真太郎','0',1,15),(300041,'ブーナ',0,'旅好きで一つの場所にずっと留まっているのが苦手。その場でしか味わえない空気を大切にする。フォルティスになって以降は、各地を巡る人と一緒にいられるのが幸せ。健康にはとても気を遣う性格','私はブーナ。…よろしく。',2,112,0,178,0,1.9,0.85,0,'ファイター',0.05,0.5,0,0,1,'anm_m_rsw0',2,11,18,1790,3,50,60,3,0,5,0,70,5,0,8,0,80,6,0,10,0,'0:100','402026:100','402020:30,402068:30,401104:20,401202:20',451602,499,4,1000,'swd006_a01','swd006_a01_2',NULL,NULL,0,0,'斎藤千和','sabi','0',1,15),(300042,'カムエ',590017,'ある城で秘密をもらしたとして無実の罪に追われたため、城の人たちに恨みを持っている。それ以来誰に対しても敵意を抱き、人を信じていない。クールな性格が行き過ぎて冷酷な一面を持つ','カムエだ。これ以上話すことはない。',2,95,0,155,0,1.9,0.85,0,'ファイター',0.05,0.5,0,0,1,'anm_m_rsw0',2,11,15,1775,3,50,60,2,0,4,0,70,4,0,7,0,80,5,0,9,0,'0:100','402008:100','402020:30,402044:30,401101:20,401204:20',450102,499,4,1000,'swd005_a01','swd005_a01_2',NULL,NULL,0,0,'赤羽根健治','ハタリス','0',1,15),(300043,'ウジル',590064,'戦争で負けた自国を独立させたいと願い剣士になる。多くの仲間の信頼を得て相手国に勝利した。男だけの生活に長くいたからか、女性が苦手。女性と目が合ったり触れ合ったりすると真っ赤になってしまう','フフッ、ウジルです。君を信頼するよ。',2,100,0,150,0,1.9,0.85,0,'ファイター',0.05,0.5,0,0,1,'anm_m_rsw0',3,11,15,1775,3,50,60,3,0,4,0,70,5,0,7,0,80,6,0,9,0,'0:100','402003:100','402015:30,402069:30,401104:20,401103:20',450102,504,4,1000,'swd019_a00','swd019_a00_3',NULL,NULL,0,0,'関智一','白亜右月','0',1,15),(300044,'ペルノシオ',0,'時代の先駆者となることを夢見る学校の先生。専任科目は音楽だがオンチである。時代を先取る音楽を日々研究中。妖精のようなかわいらしさと輝きを兼ね備えており、情熱的な恋に憧れている乙女でもある','ペルノシオです。どうぞ、よろしくお願いします。',2,109,0,162,0,1.9,0.85,0,'ファイター',0.05,0.5,0,0,1,'anm_m_rsw0',3,11,16,1780,3,50,60,3,0,4,0,70,5,0,8,0,80,6,0,9,0,'0:100','402009:100','402021:30,402045:30,401101:20,401202:20',450402,504,4,1000,'swd004_a00','swd004_a00_3',NULL,NULL,0,0,'伊藤かな恵','秋谷コウ','0',1,15),(300045,'ケシア',591001,'清楚な少女。ぬいぐるみと可愛いものが大好き。お気に入りのくまさんは決して手放さない。いつも物憂げな表情をしているのは悲しい過去の思い出を追憶しているから','ケシア、です。よろしくです。',2,90,0,130,0,1.9,0.85,0,'ファイター',0.05,0.5,0,0,1,'anm_m_rsw0',3,11,15,1775,3,50,60,2,0,3,0,70,4,0,6,0,80,5,0,7,0,'0:100','402003:100','402033:100',452202,504,4,1000,'swd025_a00','swd025_a00_3',NULL,NULL,0,0,'相沢舞','KOSO','0',1,15),(300046,'ドリー',0,'善良な市民であった。あまりぱっとしなく、目立つタイプでもないが、素朴なかわいらしさがあると言われていた。人に忘れられることを過度に嫌がるので、別れ際はなんとか自分を印象づけようと必死になる','ドリーですー。よろしくしますねー。',2,119,0,171,0,1.9,0.85,0,'ファイター',0.05,0.5,0,0,1,'anm_m_rsw0',4,11,18,1790,3,50,60,3,0,5,0,70,5,0,8,0,80,7,0,10,0,'0:100','402040:100','402016:30,402046:30,401101:20,401202:20',450302,509,4,1000,'swd009_a01','swd009_a01_4',NULL,NULL,0,0,'相沢舞','馬場一希','0',1,15),(300047,'ローラス',0,'いつも楽しそうに過去の思い出話を語る。友達がたくさんおり、彼女の周りはいつもにぎやかであった。何より友達を大事にする。死してなお、その暮らしは楽しそうである','ローラスです。ウフフフフ・・・。',2,114,0,161,0,1.9,0.85,0,'ファイター',0.05,0.5,0,0,1,'anm_m_rsw0',4,11,16,1780,3,50,60,3,0,4,0,70,5,0,8,0,80,6,0,9,0,'0:100','402028:100','402034:30,402070:30,401102:20,401204:20',450202,509,4,1000,'swd026_a00','swd026_a00_4',NULL,NULL,0,0,'大空直美','渡辺 悟','0',1,15),(300048,'ハシント',0,'若いころから槍投げが得意な少年であり、その優れた身体能力を発揮し、各地の大会で他を圧倒した。性格は穏やかで、人を傷つけることが嫌いなお人よし','ハシントという。よろしく頼む。',2,115,0,160,0,1.9,0.85,0,'ファイター',0.05,0.5,0,0,1,'anm_m_rsw0',4,11,16,1780,3,50,60,3,0,4,0,70,5,0,8,0,80,6,0,9,0,'0:100','402004:100','402022:30,402046:30,401104:20,401103:20',451602,509,4,1000,'swd011_a00','swd011_a00_4',NULL,NULL,0,0,'檜山修之','hippo','0',1,15),(300049,'ハマメイル',0,'生前は神に仕える仕事をしていた。妖（アヤカシ）や霊が良く見えたので、それをお祓いして暮らしていた。霊感を悪用して人間を怖がらせたり騙したりいたずらをするのが好き','ふふふ、ハマメイルよ～。よろしくね～。',2,109,0,166,0,1.9,0.85,0,'ファイター',0.05,0.5,0,0,1,'anm_m_rsw0',5,11,16,1780,3,50,60,3,0,4,0,70,5,0,8,0,80,6,0,9,0,'0:100','402005:100','402017:30,402023:30,401102:20,401103:20',451502,514,4,1000,'swd014_a00','swd014_a00_5',NULL,NULL,0,0,'久川綾','ウスダヒロ','0',1,15),(300050,'ユニ',0,'卑劣な手段で人を欺く詐欺師。何を言われても飄々としていて動じない。カンにさわることばかりを言う天才でもあり、色々な人物から恨みを買っていた','初めまして、私ユニと申します。期待、していますよ？',2,114,0,176,0,1.9,0.85,0,'ファイター',0.05,0.5,0,0,1,'anm_m_rsw0',5,11,18,1790,3,50,60,3,0,5,0,70,5,0,8,0,80,6,0,10,0,'0:100','402041:100','402035:30,402071:30,401104:20,401204:20',451902,514,4,1000,'swd008_a00','swd008_a00_5',NULL,NULL,0,0,'中井和哉','石商','0',1,15),(300051,'ソナリス',0,'日々の生活に変化を求めるタイプ。マンネリが嫌いで刺激的な毎日を送りたいと思っている。たまにぼーっとしているが、それは物思いにふけっているから。昔はよくいじめられていた','あたし、ソナリス。刺激的なことが起こるといいね。',2,111,0,174,0,1.9,0.85,0,'ファイター',0.05,0.5,0,0,1,'anm_m_rsw0',5,11,17,1785,3,50,60,3,0,5,0,70,5,0,8,0,80,6,0,10,0,'0:100','402011:100','402023:30,402047:30,401101:20,401202:20',452402,514,4,1000,'swd010_a00','swd010_a00_5',NULL,NULL,0,0,'伊藤かな恵','小玉','0',1,15),(300052,'パオラ',0,'とても恥ずかしがり屋かつ内気な性格なため、話をするのが苦手。いつもはにかんでおり、この笑顔を見た者は心が浄化されるような気持ちになる','パオラと言います。ふふっ。',2,176,0,274,0,1.9,0.85,0,'ファイター',0.05,0.5,0,0,1,'anm_m_rsw0',1,14,20,4350,3,60,70,5,0,8,0,80,8,0,13,0,90,10,0,16,0,'0:100','402049:100','402013:30,402019:30,401101:20,401202:20',450303,496,5,2000,'swd024_a00','swd024_a00_1',NULL,NULL,0,0,'照井春佳','ミツロ','0',1,50),(300053,'ピスナル',0,'何に対しても貪欲でミーハー。食に対しては特に貪欲でよく食べたが、その割にはスレンダー。妄想が趣味で、いつか王子様が迎えにきてくれることを願っている。可愛いものが好き','ピスナルっていうの！おいしいもの、食べさせてね？',2,175,0,275,0,1.9,0.85,0,'ファイター',0.05,0.5,0,0,1,'anm_m_rsw0',1,14,20,4350,3,60,70,5,0,8,0,80,8,0,13,0,90,10,0,16,0,'0:100','402055:100','402031:30,402043:30,401102:20,401204:20',450403,496,5,2000,'swd029_a00','swd029_a00_1',NULL,NULL,0,0,'桑島法子','騎灰ぽよ','0',1,50),(300054,'アヤ',0,'忍者の一族で生まれ育った。心配性で臆病な性格で、常に周りの環境を気にしている。あまりに臆病なので一人前のくの一にはなれなかったと自分を責めているが、今でもその夢は捨てていない','忍者総長アヤです。よ、よろしくお願いします。',2,180,0,270,0,1.9,0.85,0,'ファイター',0.05,0.5,0,0,1,'anm_m_rsw0',2,14,20,4350,3,60,70,5,0,8,0,80,9,0,13,0,90,10,0,16,0,'0:100','402050:100','402032:30,402044:30,401104:20,401103:20',451603,501,5,2000,'swd007_a00','swd007_a00_2',NULL,NULL,0,0,'三森すずこ','上田　夢人','0',1,50),(300055,'デルフィ',590029,'自分が世界で一番美しいと思っている、ナルシストでドSな女王様。顔は美人ながら身体のスタイルが自分の理想と異なっており、それをとても気にしている。自分よりグラマーな女が嫌い','わらわがデルフィじゃ。貴様をわらわの下僕として認めようぞ。',2,177,0,263,0,1.9,0.85,0,'ファイター',0.05,0.5,0,0,1,'anm_m_rsw0',2,14,20,4350,3,60,70,5,0,7,0,80,8,0,13,0,90,10,0,15,0,'0:100','402056:100','402014:30,402020:30,401102:20,401204:20',450103,501,5,2000,'swd020_a00','swd020_a00_2',NULL,NULL,0,0,'皆口裕子','白亜右月','0',1,50),(300056,'ロード',0,'王国の騎士団の勇者。親から戦士になるための訓練を受け、十代で騎士団の最前線に立つ。主君への忠誠も高く、信頼されていた','俺はロード。マスターに勝利を捧げよう。',2,182,0,268,0,1.9,0.85,0,'ファイター',0.05,0.5,0,0,1,'anm_m_rsw0',3,14,20,4350,3,60,70,5,0,8,0,80,9,0,13,0,90,10,0,16,0,'0:100','402051:100','402015:30,402033:30,401101:20,401103:20',450103,506,5,2000,'swd028_a00','swd028_a00_3',NULL,NULL,0,0,'朴?美','秋谷コウ','0',1,50),(300057,'スロリア',0,'しっかりと芯を持ったお姉さん。周りからはよく相談を受けることも。大抵のことはなんとかなると思っており、ちょっと男勝りなところもある。とても暑がり','スロリアよ。よろしくね。',2,183,0,267,0,1.9,0.85,0,'ファイター',0.05,0.5,0,0,1,'anm_m_rsw0',3,14,20,4350,3,60,70,5,0,8,0,80,9,0,13,0,90,10,0,16,0,'0:100','402057:100','402021:30,402045:30,401102:20,401204:20',451603,506,5,2000,'swd021_a01','swd021_a01_3',NULL,NULL,0,0,'井上喜久子','ゴンザレスロッキー','0',1,50),(300058,'フーリン',0,'裕福な家に生まれ、どんなことにもニコニコ応対する。いとこのセンカとはよく一緒に遊んでたため、センカがしばしば家を抜け出しているのを知っているがそれを誰にも言わず黙っていた','フーリンだよ。よろしく。',2,184,0,266,0,1.9,0.85,0,'ファイター',0.05,0.5,0,0,1,'anm_m_rsw0',4,14,20,4350,3,60,70,5,0,7,0,80,9,0,13,0,90,11,0,15,0,'0:100','402052:100','402016:30,402046:30,401104:20,401202:20',451903,511,5,2000,'swd021_a00','swd021_a00_4',NULL,NULL,0,0,'伊藤かな恵','あさぎり','0',1,50),(300059,'コルル',0,'ワガママで頑固な性格で、一度決めたことは曲げない。周りより自分は偉いと思っており、上から目線な発言をしたり毒づいたりすることもしばしばだが、困っている人に対しては優しく接するという面もある','ふんっ、コルルよ。期待しないであげるわ。',2,185,0,265,0,1.9,0.85,0,'ファイター',0.05,0.5,0,0,1,'anm_m_rsw0',4,14,20,4350,3,60,70,5,0,7,0,80,9,0,13,0,90,11,0,15,0,'0:100','402058:100','402022:30,402034:30,401101:20,401204:20',451903,511,5,2000,'swd031