好きで冒険心がある。なんでもやってみようとする情熱的なタイプではあるが、へそ曲がり。ものごとをまがってとらえる癖があり、面倒くさがられることもしばしば','ゲルンっていいます。よろしく、マスター。',2,72,0,82,0,1.55,0.75,0,'ウォーリアー',0.05,0.5,0,0,2,'anm_m_hmr0',6,8,10,900,3,40,50,2,0,2,0,60,3,0,4,0,70,4,0,4,0,'0:100','403016:100','403003:50,403004:50',451901,518,3,200,NULL,NULL,'ham001_a00','ham001_a00_2',0,0,'松風雅也','ちんちら','0',1,5),(310004,'ブレア',0,'忘れられない人がいるようで、お互い忘れないように交換したブローチを大切に肌身離さず持っている。しかし相手との連絡が途絶えてしまったのでとても不安に思っている。胃が弱い','私、ブレア。よろしくお願いします。',2,70,0,70,0,1.55,0.75,0,'ウォーリアー',0.05,0.5,0,0,2,'anm_m_hmr0',6,8,8,890,3,40,50,2,0,2,0,60,3,0,3,0,70,4,0,4,0,'0:100','403002:100','403003:50,403004:50',450401,518,3,200,NULL,NULL,'ham001_a01','ham001_a01_0',0,0,'久川綾','十重','0',1,5),(310005,'アスター',590001,'いつもご機嫌でニコニコしている。ドジっ子体質で天然なところがあり、放っておけない、と周りに人が自然と集まる。飾り気がないが、しばしばかわいらしい印象を人に与える','あたし、アスター。よっろしく、ハニー。',2,81,0,79,0,1.55,0.75,0,'ウォーリアー',0.05,0.5,0,0,2,'anm_m_hmr0',6,8,11,905,3,40,50,2,0,2,0,60,4,0,3,0,70,4,0,4,0,'0:100','403016:100','403003:50,403004:50',451501,518,3,200,NULL,NULL,'ham001_a01','ham001_a01_1',0,0,'平野文','Miki/GateAsia','0',1,5),(310006,'メンカナ',590098,'心温かく人徳があるため、人が自然と寄ってくる。来る者拒まず去る者追わずというさっぱりした考えを持っている。昔にケンカして別れてしまった友達がおり、再開したいと思っている','メンカナよ。あなたの冒険、手伝ってあげるわ。',2,79,0,75,0,1.55,0.75,0,'ウォーリアー',0.05,0.5,0,0,2,'anm_m_hmr0',6,8,10,900,3,40,50,2,0,2,0,60,4,0,3,0,70,4,0,4,0,'0:100','403016:100','403004:100',451901,518,3,200,NULL,NULL,'ham001_a01','ham001_a01_2',0,0,'井上喜久子','kamiore/GateAsia','0',1,5),(310007,'クムミル',0,'夫と永遠の愛を誓った女性で、旦那に献身的に尽くしていた。老後も美しさを保ち続け、羨望の眼差しを受けた。若い頃に夫と過ごした輝かしい思い出をずっと覚えている','私がクムミルです。今後ともよろしくお願いします。',2,95,0,89,0,1.55,0.75,0,'ウォーリアー',0.05,0.5,0,0,2,'anm_m_hmr0',1,8,13,915,3,40,50,2,0,2,0,60,4,0,4,0,70,5,0,5,0,'0:100','403002:100','403003:50,403004:50',451501,493,3,200,NULL,NULL,'ham002_a01','ham002_a01_1',0,0,'皆口裕子','ゴンザレスロッキー','0',1,5),(310008,'レニス',0,'学生であった。そこそこ頭がよく勉強は出来る方。無邪気で明るい少年であるが、人が大好きなあまり、ちょっぴりお節介なところもある。女の子には特に優しい紳士であったため学校ではよくモテた','こんにちは、レニスです。',2,92,0,84,0,1.55,0.75,0,'ウォーリアー',0.05,0.5,0,0,2,'anm_m_hmr0',1,8,12,910,3,40,50,2,0,2,0,60,4,0,4,0,70,5,0,5,0,'0:100','403011:100','403003:50,403004:50',450401,493,3,200,NULL,NULL,'ham003_a00','ham003_a00_1',0,0,'松風雅也','はかせ','0',1,5),(310009,'ニナタム',0,'背は低いが立派な大人。優しい性格で、着る服はひらひらしたものが好き。虫退治が得意で、虫が出て困っている人の所へいつでも飛んできて対処してくれる','ニナタムだよ。よろしく～。',2,97,0,87,0,1.55,0.75,0,'ウォーリアー',0.05,0.5,0,0,2,'anm_m_hmr0',1,8,13,915,3,40,50,2,0,2,0,60,4,0,4,0,70,5,0,5,0,'0:100','403002:100','403003:50,403004:50',451501,493,3,200,NULL,NULL,'ham003_a01','ham003_a01_1',0,0,'平野文','仲原','0',1,5),(310010,'プルネ',0,'人の話を受け流しているかに見えて、一語一句漏らさず記憶している。記者をしているが、機械的に処理する能力に長けており、速記が異常に正確だった。一方で喋ることとなるとハキハキしているが内容は適当','プルネだ。面白い記事、期待してるぜ。',2,91,0,93,0,1.55,0.75,0,'ウォーリアー',0.05,0.5,0,0,2,'anm_m_hmr0',2,8,13,915,3,40,50,2,0,2,0,60,4,0,4,0,70,5,0,5,0,'0:100','403012:100','403003:50,403004:50',450401,498,3,200,NULL,NULL,'ham002_a01','ham002_a01_2',0,0,'関智一','箱','0',1,5),(310011,'メリーナ',0,'周りの人たちを明るく爽快にさせ、心を前向きにさせるセラピスト。人の相談をよく受ける。好物はハチミツで、危険を顧みずハチミツを取りに行く勇姿は周りに尊敬されていた','メリーナですぅ。お困りごとですかぁ？',2,90,0,94,0,1.55,0.75,0,'ウォーリアー',0.05,0.5,0,0,2,'anm_m_hmr0',2,8,13,915,3,40,50,2,0,2,0,60,4,0,4,0,70,5,0,5,0,'0:100','403002:100','403003:50,403004:50',450401,498,3,200,NULL,NULL,'ham003_a00','ham003_a00_2',0,0,'照井春佳','たいちょ','0',1,5),(310012,'クリビア',0,'高貴な城の出身。情け深い性格で、お人よし。すぐ相手に入れ込んでしまう悪い癖がある。騙されたことにも気づかないので、気づいた時にはいろんなものを失っていることが多かった','クリビアですの。頑張りますわ。',2,85,0,91,0,1.55,0.75,0,'ウォーリアー',0.05,0.5,0,0,2,'anm_m_hmr0',2,8,12,910,3,40,50,2,0,2,0,60,4,0,4,0,70,5,0,5,0,'0:100','403012:100','403003:50,403004:50',452101,498,3,200,NULL,NULL,'ham003_a01','ham003_a01_2',0,0,'三森すずこ','さんにゃ','0',1,5),(310013,'ユース',590007,'お話を語るのが上手な紙芝居屋さん。地方を回って自分で作った絵本を子供たちの前で披露していた。その絵と話は子供だけでなく大人にも人気。大の子供好きで、思いやりのある性格','ユースの紙芝居、始まるわよ～。',2,78,0,86,0,1.55,0.75,0,'ウォーリアー',0.05,0.5,0,0,2,'anm_m_hmr0',3,8,11,905,3,40,50,2,0,2,0,60,3,0,4,0,70,4,0,5,0,'0:100','403002:100','403003:50,403004:50',450301,503,3,200,NULL,NULL,'ham002_a01','ham002_a01_3',0,0,'皆口裕子','さんにゃ','0',1,5),(310014,'パニーラ',0,'普段は研究室にこもっている生物学者だが、人の話を聞くのが何よりも好き。悩みを一緒に共感できる相談役にな