0','400301:100','401105:100',450301,518,3,200,'rod001_a00','rod001_a00_2','bok001_a00','rod001_a00_2',0,0,'朴?美','薫唯','0',1,5),(320004,'フューシャ',0,'弓、書、お花、お茶、と多趣味で、そのどれも上品にこなした。使う道具を愛しすぎるがあまり、「道具を使うのはもったいない」と思っている。自他共に認める道具コレクターでもあった','ごきげんよう。フューシャでございます。',2,13,0,127,0,1.5,0.85,0,'ソーサラー',0.05,0.5,0,0,3,'anm_m_rod0',6,8,8,890,3,40,50,0,0,4,0,60,0,0,6,0,70,0,0,8,0,'0:100','400401:100','401105:100',450401,518,3,200,'rod001_a01','rod001_a01_0','bok001_a01','rod001_a01_0',0,0,'相沢舞','路地子','0',1,5),(320005,'ランディ',590046,'気品があるお嬢様。物事に誠実できっちりした性格。従順なので、一度懐いたら変わらない愛情を持って接することができる。ただし、懐いてもらうまでに相当の時間と根気が必要','ランディと申します。よろしくお願いいたします。',2,12,0,132,0,1.5,0.85,0,'ソーサラー',0.05,0.5,0,0,3,'anm_m_rod0',6,8,9,895,3,40,50,0,0,4,0,60,0,0,7,0,70,0,0,8,0,'0:100','400501:100','401105:100',450301,518,3,200,'rod001_a01','rod001_a01_1','bok001_a01','rod001_a01_1',0,0,'照井春佳','新堂アラタ','0',1,5),(320006,'スプル',590010,'家族を大切にし、夫と良い家庭を持っている。いつもエネルギッシュで頭が切れる。趣味は料理。その味はいつも周りを感動させるほどの実力者。この世で一番おいしいと言われる料理を作れる人間になりたかった','はーい、スプルよ。私の料理、食べてって！',2,13,0,154,0,1.5,0.85,0,'ソーサラー',0.05,0.5,0,0,3,'anm_m_rod0',6,8,11,905,3,40,50,0,0,4,0,60,0,0,7,0,70,0,0,9,0,'0:100','400101:100','401105:100',451901,518,3,200,'rod001_a01','rod001_a01_2','bok001_a01','rod001_a01_2',0,0,'朴?美','ちんちら','0',1,5),(320007,'ターゲス',590010,'優れた医術者。ネルケの師匠で、若い頃からその実力はすばらしく、賞賛されていた。困っている人を見ると放っておけず身分の差などなく分け隔てなく治療にあたった。自分自身も生きることをとても大事にしており、むやみに命を投げ出すものは許さなかった','ターゲスです。医者をやっております。',2,12,0,148,0,1.5,0.85,0,'ソーサラー',0.05,0.5,0,0,3,'anm_m_rod0',1,8,11,905,3,40,50,0,0,4,0,60,0,0,7,0,70,0,0,8,0,'0:100','400101:100','401105:100',451601,493,3,200,'rod002_a00','rod002_a00_1','bok002_a00','rod002_a00_1',0,0,'赤羽根健治','ひのえ','0',1,5),(320008,'リナリア',590023,'片思いをしているが相手は幻想の人。自分の好みで作った妄想の人を愛している乙女。いつもどこを見ているか分からず、時々空気と会話している姿が伺えるが、本人は見えない彼と話しているつもりだという','私はリナリア。恋する乙女ですわ。',2,10,0,144,0,1.5,0.85,0,'ソーサラー',0.05,0.5,0,0,3,'anm_m_rod0',1,8,10,900,3,40,50,0,0,4,0,60,0,0,7,0,70,0,0,8,0,'0:100','400102:100','401105:100',451601,493,3,200,'rod002_a01','rod002_a01_1','bok002_a01','rod002_a01_1',0,0,'平野文','Ixy','0',1,5),(320009,'シロリア',0,'宗教に熱中していて、神しか信じていない妄信的な人間。対照的に人間やその他動物などには排他的で一切心を開かないため、彼女に話かけるには神をダシに使うしかない。見た目はいつも奇抜な格好をしている','これも神様の導き…シロリアです。',2,16,0,151,0,1.5,0.85,0,'ソーサラー',0.05,0.5,0,0,3,'anm_m_rod0',1,8,11,905,3,40,50,0,0,4,0,60,0,0,7,0,70,0,0,9,0,'0:100','400104:100','401105:100',450501,493,3,200,'rod003_a00','rod003_a00_1','bok003_a00','rod003_a00_1',0,0,'井上喜久子','十重','0',1,5),(320010,'モラーサ',590010,'不思議な道具によって人の過去を見ることが出来る少女。「記憶や思い出を自分のことのように追体験でき、未来の幸福なことを教えることが出来る占い師のような人物。本人は自分の過去を話したがらない','モラーサといいます。ふふ、あなたの未来は・・？',2,15,0,129,0,1.5,0.85,0,'ソーサラー',0.05,0.5,0,0,3,'anm_m_rod0',2,8,9,895,3,40,50,0,0,4,0,60,0,0,6,0,70,0,0,8,0,'0:100','400201:100','401105:100',450401,498,3,200,'rod002_a00','rod002_a00_2','bok002_a00','rod002_a00_2',0,0,'三森すずこ','mado*pen','0',1,5),(320011,'ザスラ',590023,'見た目は筋肉質で健康的。しかし、その性格は物思いにふけることが多く内気なタイプで、人前に出るのは苦手。知識は豊富で、柔軟に物事を考えられるので攻撃より戦略を練る方が得意','ザ、ザスラです。よろしくおねがいします。',2,18,0,149,0,1.5,0.85,0,'ソーサラー',0.05,0.5,0,0,3,'anm_m_rod0',2,8,11,905,3,40,50,0,0,4,0,60,0,0,7,0,70,1,0,8,0,'0:100','400202:100','401105:100',450401,498,3,200,'rod002_a01','rod002_a01_2','bok002_a01','rod002_a01_2',0,0,'赤羽根健治','マボ','0',1,5),(320012,'タリラ',590010,'あどけない印象を受ける、無邪気で純粋な少女。他人に対して愛想がよく、誰とでも仲良くできる。彼女からはいい香りがするという','うふふっ。タリラよ。',2,19,0,144,0,1.5,0.85,0,'ソーサラー',0.05,0.5,0,0,3,'anm_m_rod0',2,8,11,905,3,40,50,0,0,4,0,60,0,0,7,0,70,1,0,8,0,'0:100','400203:100','401105:100',450401,498,3,200,'rod003_a00','rod003_a00_2','bok003_a00','rod003_a00_2',0,0,'井上喜久子','シロジ','0',1,5),(320013,'ザンカ',0,'独身。惚れっぽい性格で、顔や体のどのパーツでも自分好みのポイントが一つでもあれば好きになってしまう、恋多き困ったアラサー女性。好きなものにはとことん一途だが、容姿の良い男性にはいいように利用されることもしばしば。暴走気味な性格で、あまり落ち着きがない','麗しの美女ザンカです。よろしくね♪',2,22,0,161,0,1.5,0.85,0,'ソーサラー',0.05,0.5,0,0,3,'anm_m_rod0',3,8,13,915,3,40,50,0,0,4,0,60,1,0,8,0,70,1,0,9,0,'0:100','400301:100','401105:100',451901,503,3,200,'rod002_a00','rod002_a00_3','bok002_a00','rod002_a00_3',0,0,'皆口裕子','Esphy','0',1,5),(320014,'キルタ',590064,'恥ずかしがり屋でいつも前髪で目を隠しており、あまりハッキリものごとを言わない。自分に自信がないタイプ。目立つことが苦手で学校の行事などには不参加し続けた。友達のジーフィーには心を許している。よく面倒を見てくれ、ハツラツとしているジーフィーにちょっぴり憧れを抱いていた','は、はじめましてキルタです。よ、よろしく…',2,22,0,149,0,1.5,0.85,0,'ソーサラー',0.05,0.5,0,0,3,'anm_m_rod0',3,8,12,910,3,40,50,0,0,4,0,60,1,0,7,0,70,1,0,8,0,'0:100','400302:100','401105:100',450501,503,3,200,'rod002_a01','rod002_a01_3','bok002_a01','rod002_a01_3',0,0,'朴?美','マボ','0',1,5),(320015,'マルハ',0,'よぼよぼのおじいちゃん。ぽーっとして何も考えてないフリをして、実際は何かを考えている。人の名前を全く覚えられず、聞いてもその場で忘れてしまうが、昔勇者だったころの自分の武勇伝はいつになっても忘れない。強力な仙人であるとのウワサも。孫のブーナがいつも気がかりだが、やはり名前を忘れている','え？なんじゃ？ワシはマルハじゃ。',2,17,0,166,0,1.5,0.85,0,'ソーサラー',0.05,0.5,0,0,3,'anm_m_rod0',3,8,13,915,3,40,50,0,0,4,0,60,0,0,8,0,70,1,0,9,0,'0:100','400303:100','401105:100',450401,503,3,200,'rod003_a00','rod003_a00_3','bok003_a00','rod003_a00_3',0,0,'檜山修之','ENIGMAX?','0',1,5),(320016,'シンビィ',0,'たおやかな立ち居振る舞いと聡明な物言いをする優雅な女性。高貴な出自を持ち、使用人を何十人と抱える屋敷の一人娘であったが、一切気取ることはなく多くの人から愛された','私シンビィと申します。この出会いに感謝いたします。',2,15,0,156,0,1.5,0.85,0,'ソーサラー',0.05,0.5,0,0,3,'anm_m_rod0',4,8,12,910,3,40,50,0,0,4,0,60,0,0,7,0,70,0,0,9,0,'0:100','400401:100','401105:100',450501,508,3,200,'rod002_a00','rod002_a00_4','bok002_a00','rod002_a00_4',0,0,'大空直美','ENIGMAX?','0',1,5),(320017,'イデス',0,'純粋な性格。頭がよく、いろいろなことを器用にこなす多才な少年。家は町では有名な薬屋であった。弟の才能が羨ましいのか妬ましいのか、姉のコルルによくケンカを売られた','僕はイデス。よろしくね。',2,15,0,168,0,1.5,0.85,0,'ソーサラー',0.05,0.5,0,0,3,'anm_m_rod0',4,8,13,915,3,40,50,0,0,5,0,60,0,0,8,0,70,0,0,10,0,'0:100','400402:100','401105:100',450301,508,3,200,'rod002_a01','rod002_a01_4','bok002_a01','rod002_a01_4',0,0,'松風雅也','兎鷺','0',1,5),(320018,'ロンロン',0,'情熱的な性格。思ったことや感情をすぐ口に出してしまう。後先を考えずに突っ走ってしまうタイプで、自制心が足りない。女の子らしさは感じられなく男の子っぽい','おっとっとぉ！ロンロンだよお！',2,14,0,169,0,1.5,0.85,0,'ソーサラー',0.05,0.5,0,0,3,'anm_m_rod0',4,8,13,915,3,40,50,0,0,5,0,60,0,0,8,0,70,0,0,10,0,'0:100','400403:100','401105:100',451601,508,3,200,'rod003_a00','rod003_a00_4','bok003_a00','rod003_a00_4',0,0,'伊藤かな恵','sabi','0',1,5),(320019,'リカ',590047,'言葉数少なく、いつも一人でいる孤独な子。よくいじめられていたせいでとても弱気でひがみっぽくなっているが、恨むことなく誰にでも平等に接しようとする','リカと・・いいます・・・私なんかで・・',2,10,0,144,0,1.5,0.85,0,'ソーサラー',0.05,0.5,0,0,3,'anm_m_rod0',5,8,10,900,3,40,50,0,0,4,0,60,0,0,7,0,70,0,0,8,0,'0:100','400501:100','401105:100',450301,513,3,200,'rod002_a00','rod002_a00_5','bok002_a00','rod002_a00_5',0,0,'三森すずこ','Nunohito','0',1,5),(320020,'ビラウィット',0,'物静かで常に何かを考えているような素振りを見せているが、大概は瞑想中であまり人の話を聞いていない。穏やかな日常を手にしたいと思っており、慌ただしく忙しいことが嫌い','あ、ビラウィットです。考え事してました。',2,17,0,158,0,1.5,0.85,0,'ソーサラー',0.05,0.5,0,0,3,'anm_m_rod0',5,8,12,910,3,40,50,0,0,4,0,60,0,0,7,0,70,1,0,9,0,'0:100','400502:100','401105:100',450501,513,3,200,'rod002_a01','rod002_a01_5','bok002_a01','rod002_a01_5',0,0,'久川綾','Esphy','0',1,5),(320021,'スキラ',0,'辛抱強く冷静で、他人には何でもないように強気に振る舞っているが、実は寂しさをいつも感じている。本当は人と一緒に遊んだり話したりしたいと思っている。奴隷として長い間牢に囚われていた過去を持つ','スキラです。辛抱づよいほう、だと思います。',2,18,0,153,0,1.5,0.85,0,'ソーサラー',0.05,0.5,0,0,3,'anm_m_rod0',5,8,12,910,3,40,50,0,0,4,0,60,0,0,7,0,70,1,0,9,0,'0:100','400503:100','401105:100',451901,513,3,200,'rod003_a00','rod003_a00_5','bok003_a00','rod003_a00_5',0,0,'皆口裕子','新堂アラタ','0',1,5),(320022,'エビネ',590047,'人に優しく大らかだが、うるさいくらいにぎやかな性格。人を楽しませることが大好きで、周りの笑顔が彼の生きがいであり、彼の周りは笑顔の絶えることがない。婚約者のスロリアを愛している','いよぉ。エビネだ。よろしくな。',2,18,0,149,0,1.5,0.85,0,'ソーサラー',0.05,0.5,0,0,3,'anm_m_rod0',1,8,11,905,3,40,50,0,0,4,0,60,1,0,7,0,70,1,0,8,0,'0:100','400101:100','401105:100',451901,493,3,200,'rod003_a01','rod003_a01_1','bok003_a01','rod003_a01_1',0,0,'檜山修之','syoujin','0',1,5),(320023,'レニ',0,'高貴な家で生まれ育ったお譲様。プライドが高く、涙を見せるのを極端に嫌がる。派手な見た目をしているが、立ち振る舞いはしなやかで、習い事なども充実していた','レニっていうの。とりあえず、よろしく。',2,21,0,159,0,1.5,0.85,0,'ソーサラー',0.05,0.5,0,0,3,'anm_m_rod0',1,8,12,910,3,40,50,0,0,4,0,60,1,0,7,0,70,1,0,9,0,'0:100','400102:100','401105:100',450501,493,3,200,'rod004_a00','rod004_a00_1','bok004_a00','rod004_a00_1',0,0,'大空直美','絵西','0',1,5),(320024,'ステラ',590047,'愛らしい見た目の女性。甘え上手で、年齢のわりに誰からも可愛がられる。昔はよく好きな人と密会していた。好きな人のためなら一生懸命になる','えーっと、ステラですぅ。よろしく？',2,21,0,150,0,1.5,0.85,0,'ソーサラー',0.05,0.5,0,0,3,'anm_m_rod0',1,8,12,910,3,40,50,0,0,4,0,60,1,0,7,0,70,1,0,9,0,'0:100','400104:100','401105:100',450501,493,3,200,'rod004_a01','rod004_a01_1','bok004_a01','rod004_a01_1',0,0,'久川綾','仲原','0',1,5),(320025,'ベル',0,'身体が弱く、部屋にひきこもりがちであった。外をあまり知らないため、外の世界に幻想を抱いている。とても優しいが、筋が通っていないと許せない性格。弟のランジと二人暮らしで、深い愛情を抱いていた','ベルといいます。どうぞよろしくお願いしますね。',2,23,0,160,0,1.5,0.85,0,'ソーサラー',0.05,0.5,0,0,3,'anm_m_rod0',2,8,13,915,3,40,50,0,0,4,0,60,1,0,8,0,70,1,0,9,0,'0:100','400201:100','401105:100',451901,498,3,200,'rod003_a01','rod003_a01_2','bok003_a01','rod003_a01_2',0,0,'朴?美','まっつん！','0',1,5),(320026,'グラーシス',0,'素直で気ままなスイマーであった。水が好きで小さい頃からの夢である、プロのスイマーになるためにずっと努力を惜しまなかった努力家。泳げない人、水難に遭っている人を見るとすぐ助けにいってしまう','Hello～♪グラーシスでーすよ～♪',2,17,0,166,0,1.5,0.85,0,'ソーサラー',0.05,0.5,0,0,3,'anm_m_rod0',2,8,13,915,3,40,50,0,0,4,0,60,0,0,8,0,70,1,0,9,0,'0:100','400202:100','401105:100',451601,498,3,200,'rod004_a00','rod004_a00_2','bok004_a00','rod004_a00_2',0,0,'桑島法子','まっつん！','0',1,5),(320027,'ロラリア',0,'雪や寒いところが大好きで、スキーが得意であった。スキーの大ジャンプを優雅にこなすことができた。優しく、親和な性格で、ケンカや争いごとを好まない','ロラリアです。お近づきの印にはい、ゆきだるま。',2,16,0,167,0,1.5,0.85,0,'ソーサラー',0.05,0.5,0,0,3,'anm_m_rod0',2,8,13,915,3,40,50,0,0,5,0,60,0,0,8,0,70,0,0,10,0,'0:100','400203:100','401105:100',451601,498,3,200,'rod004_a01','rod004_a01_2','bok004_a01','rod004_a01_2',0,0,'三森すずこ','仲原','0',1,5),(320028,'ムジン',0,'町角で一人、ダンスを披露していた有名な踊り子。美しい瞳を持ち、その瞳に見つめられてダンスに誘われると、どんな人でも必ず一緒に踊りたくなってしまう。ちょっぴりいたずらっ子','ムジンっていうんだ。一緒に踊ろう！',2,15,0,165,0,1.5,0.85,0,'ソーサラー',0.05,0.5,0,0,3,'anm_m_rod0',3,8,12,910,3,40,50,0,0,4,0,60,0,0,8,0,70,0,0,9,0,'0:100','400301:100','401105:100',450401,503,3,200,'rod003_a01','rod003_a01_3','bok003_a01','rod003_a01_3',0,0,'朴?美','yurinko','0',1,5),(320029,'ラシルス',590022,'繊細かつ几帳面で、細かいことがとても気になってしまう性格。口うるさく、いじわるばあさんと呼ばれていた。家事には厳しく、指で埃をなぞってはダメ出しをして悪態をついた','ラシルスじゃ。ったく、最近の若いもんは・・・。',2,11,0,143,0,1.5,0.85,0,'ソーサラー',0.05,0.5,0,0,3,'anm_m_rod0',3,8,10,900,3,40,50,0,0,4,0,60,0,0,7,0,70,0,0,8,0,'0:100','400302:100','401105:100',450301,503,3,200,'rod004_a00','rod004_a00_3','bok004_a00','rod004_a00_3',0,0,'朴?美','zaneri','0',1,5),(320030,'トリリム',590064,'見た目や態度は勤勉実直で真面目。派手さはなく地味で目立たない。好きな人がおり、その人の幸せを願っている