04_a00','rod004_a00_5','bok004_a00','rod004_a00_5',0,0,'大空直美','メデタ','0',1,5),(320036,'メサリカ',0,'負けず嫌いで困難に向き合うひたむきさがある。ちょっと謙遜しがちで自分にあまり自信がないが、愛嬌があり、年上にもよく好かれる。理想の王子様を求め探している','はーい！メサリカでーす！',2,23,0,160,0,1.5,0.85,0,'ソーサラー',0.05,0.5,0,0,3,'anm_m_rod0',5,8,13,915,3,40,50,0,0,4,0,60,1,0,8,0,70,1,0,9,0,'0:100','400503:100','401105:100',451901,513,3,200,'rod004_a01','rod004_a01_5','bok004_a01','rod004_a01_5',0,0,'相沢舞','Ixy','0',1,5),(320037,'トラデス',590067,'とても快活で元気いっぱいの女の子。元々人懐っこい性格であるが、主である人には特に親しく、尊敬の意を込めて接する。時折見せる艶っぽい表情や仕草にギャップがある。暑いところがとても苦手','トラデスっていうの。よろしくね、ご主人様。',2,24,0,226,0,1.5,0.85,0,'ソーサラー',0.05,0.5,0,0,3,'anm_m_rod0',1,11,15,1775,3,50,60,0,0,6,0,70,1,0,11,0,80,1,0,13,0,'0:100','400101:100','401105:60,400103:20',451602,494,4,1000,'rod005_a01','rod005_a01_1','bok005_a01','rod005_a01_1',0,0,'斎藤千和','薫唯','0',1,15),(320038,'バラミナ',0,'せっかちで短気な人。なかなか人に心を開いてはくれない。自分からも近寄らないが、人から触れられることすら嫌っている。過去に友達から仲間はずれにされたことがきっかけになっている','バラミナだ。・・・もういいかな？',2,26,0,254,0,1.5,0.85,0,'ソーサラー',0.05,0.5,0,0,3,'anm_m_rod0',1,11,17,1785,3,50,60,0,0,7,0,70,1,0,12,0,80,1,0,15,0,'0:100','400102:100','401105:60,400103:20',450502,494,4,1000,'rod026_a00','rod026_a00_1','bok026_a00','rod026_a00_1',0,0,'松風雅也','はかせ','0',1,15),(320039,'チュニア',0,'人と常に一緒にいないとダメなタイプ。誰かが隣にぴったりいないと急に息が苦しくなり始め過呼吸になる。根っからの苦労性で、貧乏くじを引く確率が高い損な役回りであった','チュニアです。傍にいさせて…',2,26,0,264,0,1.5,0.85,0,'ソーサラー',0.05,0.5,0,0,3,'anm_m_rod0',1,11,18,1790,3,50,60,0,0,7,0,70,1,0,13,0,80,1,0,15,0,'0:100','400101:100','401105:60,400103:20',450502,494,4,1000,'rod006_a01','rod006_a01_1','bok006_a01','rod006_a01_1',0,0,'井上喜久子','ss39','0',1,15),(320040,'ノイミ',0,'職業は郵便屋であった。「みんなにお手紙と幸せを運ぶ」をコンセプトにしていたが、おっちょこちょいでよく届け先を間違えてしまっていた。口癖は「気にしない」の失敗にへこたれないポジティブな子。人が喜んでくれることが自分の幸せ。よく配達に行っていたカントのことが好き','こんにちは、ノイミです。お手紙お届けにまいりました。',2,25,0,265,0,1.5,0.85,0,'ソーサラー',0.05,0.5,0,0,3,'anm_m_rod0',2,11,18,1790,3,50,60,0,0,7,0,70,1,0,13,0,80,1,0,15,0,'0:100','400201:100','401105:60,400203:20',450302,499,4,1000,'rod005_a01','rod005_a01_2','bok005_a01','rod005_a01_2',0,0,'桑島法子','ゴンザレスロッキー','0',1,15),(320041,'シャクナ',590047,'規律を守ることに厳格で自分にも他人にも厳しい。また、警戒心が強く、人をあまり信用しない所がある。そんな堅物然とした性格とは裏腹に、無類の子供好きであり、学校の教師をしていた。子供に対しては非常に甘い一面を持つ','私の名はシャクナでございます。ビシビシッいきますよ。',2,20,0,230,0,1.5,0.85,0,'ソーサラー',0.05,0.5,0,0,3,'anm_m_rod0',2,11,15,1775,3,50,60,0,0,6,0,70,1,0,11,0,80,1,0,13,0,'0:100','400202:100','401105:60,400203:20',450502,499,4,1000,'rod026_a00','rod026_a00_2','bok026_a00','rod026_a00_2',0,0,'井上喜久子','hippo','0',1,15),(320042,'イリス',0,'教会の神父。自分も含めたフォルティスが神と同様の存在に扱われることを嫌っている。人々の幸せを願うべき職業であるにも関わらず、自分以外のフォルティスや人間には厳しく、好き嫌いが激しい。ただし、女好きで女性には甘い','イリスです。神のご加護がありますように・・・',2,28,0,252,0,1.5,0.85,0,'ソーサラー',0.05,0.5,0,0,3,'anm_m_rod0',2,11,17,1785,3,50,60,0,0,7,0,70,1,0,12,0,80,1,0,15,0,'0:100','400201:100','401105:60,400203:20',452102,500,4,1000,'rod006_a01','rod006_a01_2','bok006_a01','rod006_a01_2',0,0,'小野坂昌也','KOSO','0',1,15),(320043,'メーコ',590023,'無口で物静かな女の子で、返事は「ふーん」「そう」などたった一言で終わらせる。あまり両親と会話をしてこなかったようで、今でも人と会話することがとても苦手である。甘いものがとても好きで、あげるととても喜ぶ','メーコ。よろしく。',2,26,0,224,0,1.5,0.85,0,'ソーサラー',0.05,0.5,0,0,3,'anm_m_rod0',3,11,15,1775,3,50,60,0,0,6,0,70,1,0,11,0,80,1,0,13,0,'0:100','400301:100','401105:60,400303:20',450502,504,4,1000,'rod005_a01','rod005_a01_3','bok005_a01','rod005_a01_3',0,0,'平野文','ピナケス','0',1,15),(320044,'ソフィラ',0,'いつも夢見心地でふわふわしている。自分に不利なことでも、嫌なことでも、あらゆることに動じない能天気な性格。昔よく一緒に星を見ていた友達を亡くし「お星様になった友達が流れ星で帰ってくるように」と毎日切実に願っている','うふふ、ソフィラですよ～♪',2,30,0,254,0,1.5,0.85,0,'ソーサラー',0.05,0.5,0,0,3,'anm_m_rod0',3,11,17,1785,3,50,60,0,0,7,0,70,1,0,12,0,80,1,0,15,0,'0:100','400302:100','401105:60,400303:20',452202,504,4,1000,'rod026_a00','rod026_a00_3','bok026_a00','rod026_a00_3',0,0,'皆口裕子','ウスダヒロ','0',1,15),(320045,'カタリス',0,'離れ離れになってしまった祖父母を想っている。祖父母の体調があまり良くなかったため、薬や魔法の研究をしていた。彼女の作った魔法や薬は有名で、それを求めて遠くからも人がやってきた。いつかその薬を求めて祖父母が会いに来るのではないかと思い、研究を続けていた','カタリスっていうの。研究ばっかしてるわ。',2,32,0,258,0,1.5,0.85,0,'ソーサラー',0.05,0.5,0,0,3,'anm_m_rod0',3,11,18,1790,3,50,60,0,0,7,0,70,1,0,12,0,80,1,0,15,0,'0:100','400301:100','401105:60,400303:20',451902,504,4,1000,'rod007_a01','rod007_a01_3','bok007_a01','rod007_a01_3',0,0,'三森すずこ','ピナケス','0',1,15),(320046,'ヒーリス',0,'無邪気でお人よしな乙女。本人の意図しないところで相手をその気にさせてしまうクセがある。そのため彼女を慕っている男性は多い。明るく元気なその性格は周りの人たちを幸せな気分にさせる','ヒーリスです。なんだか初めて会った感じがしませんね。',2,33,0,257,0,1.5,0.85,0,'ソーサラー',0.05,0.5,0,0,3,'anm_m_rod0',4,11,18,1790,3,50,60,0,0,7,0,70,1,0,12,0,80,1,0,15,0,'0:100','400401:100','401105:60,400403:20',450402,509,4,1000,'rod005_a01','rod005_a01_4','bok005_a01','rod005_a01_4',0,0,'皆口裕子','薫唯','0',1,15),(320047,'イラトマ',0,'真面目な性格。美しさとは何か、と常に考える。哲学的考えの持ち主で、その考え方はしばしば周りの理解の範疇を超えている。愛による絆を信じており、世界は愛で救われる、という考えを持っている。いつも考え事をしているのであまりしゃべらない','ふわぁ～…あら、こんにちは。私、イラトマといいますわ。',2,32,0,242,0,1.5,0.85,0,'ソーサラー',0.05,0.5,0,0,3,'anm_m_rod0',4,11,16,1780,3,50,60,0,0,7,0,70,1,0,12,0,80,1,0,14,0,'0:100','400402:100','401105:60,400403:20',451602,509,4,1000,'rod026_a00','rod026_a00_4','bok026_a00','rod026_a00_4',0,0,'斎藤千和','葉山えいし','0',1,15),(320048,'ノビリス',0,'勝利や名誉にこだわるタイプで、それらを得るためには手段を選ばない少々卑劣な男。それゆえ人を裏切ってしまい周りの信用をなくすことが多い。嘘や演技が上手','よぉ、俺の名はノビリス。よろしく頼むぜ。',2,27,0,253,0,1.5,0.85,0,'ソーサラー',0.05,0.5,0,0,3,'anm_m_rod0',4,11,17,1785,3,50,60,0,0,7,0,70,1,0,12,0,80,1,0,15,0,'0:100','400401:100','401105:60,400403:20',450502,510,4,1000,'rod007_a00','rod007_a00_4','bok007_a00','rod007_a00_4',0,0,'小野坂昌也','石商','0',1,15),(320049,'エザク',0,'高い教養のある図書館の司書。言葉数は少ないが口を開けば歯に衣着せぬ物言いで本質をズバリと言い当てる。本を読むことが何より好きで、人付き合いをあまり好まない孤高の性格の持ち主','エザクといいます。本はいいですね。情報が多くて。',2,25,0,249,0,1.5,0.85,0,'ソーサラー',0.05,0.5,0,0,3,'anm_m_rod0',5,11,16,1780,3,50,60,0,0,7,0,70,1,0,12,0,80,1,0,14,0,'0:100','400501:100','401105:60,400503:20',450502,514,4,1000,'rod005_a01','rod005_a01_5','bok005_a01','rod005_a01_5',0,0,'赤羽根健治','メデタ','0',1,15),(320050,'ヴァラン',0,'寂しがり屋。何に対しても受け身で、発言力も弱く、人をいつも待っているタイプ。他力本願で、誰かが助けてくれるのを期待している。寒いところが好きなので寒いと元気になる','あ、ヴァランです。よろしくお願いします。',2,25,0,259,0,1.5,0.85,0,'ソーサラー',0.05,0.5,0,0,3,'anm_m_rod0',5,11,17,1785,3,50,60,0,0,7,0,70,1,0,12,0,80,1,0,15,0,'0:100','400502:100','401105:60,400503:20',450502,514,4,1000,'rod026_a00','rod026_a00_5','bok026_a00','rod026_a00_5',0,0,'朴?美','メデタ','0',1,15),(320051,'ネレム',0,'お姫様のような生活を夢に見ている。その夢にかける情熱は誰にも負けない。普段は自分について多く語りたがらず、憂鬱な表情をしている','ネレムですわ。お姫様になるために修行中よ。',2,25,0,265,0,1.5,0.85,0,'ソーサラー',0.05,0.5,0,0,3,'anm_m_rod0',5,11,18,1790,3,50,60,0,0,7,0,70,1,0,13,0,80,1,0,15,0,'0:100','400501:100','401105:60,400503:20',451602,514,4,1000,'rod017_a01','rod017_a01_5','bok017_a01','rod017_a01_5',0,0,'伊藤かな恵','葉山えいし','0',1,15),(320052,'ジェンティー',590047,'悲しんでいる人がいると声をかけずにはいられない。一見その人を慰める優しい人物かと思われるのだが、実はそれをチャンスとばかりに相手に付け入ろうとする、なんとも下衆な性格をしている','あぁ、ジェンディーです。慰めてあげてもいいわ。',2,39,0,401,0,1.5,0.85,0,'ソーサラー',0.05,0.5,0,0,3,'anm_m_rod0',1,14,20,4350,3,60,70,1,0,12,0,80,1,0,20,0,90,2,0,24,0,'0:100','400101:100','401105:55,400103:15,400104:15,400105:15',450503,496,5,2000,'rod019_a00','rod019_a00_1','bok019_a00','rod019_a00_1',0,0,'朴?美','小森ニコ','0',1,50),(320053,'ナリティ',0,'きれいな心の持ち主。特技は乙女の勘を働かすことで、何もかも知っているのかと思われるほどその勘はよく的中する。周りからはエスパーだと思われている','ふふふ、ナリティです。あなたの考え、当ててみましょうか？',2,45,0,405,0,1.5,0.85,0,'ソーサラー',0.05,0.5,0,0,3,'anm_m_rod0',1,14,20,4350,3,60,70,1,0,12,0,80,2,0,20,0,90,2,0,24,0,'0:100','400102:100','401105:55,400103:15,400104:15,400105:15',450503,496,5,2000,'rod017_a00','rod017_a00_1','bok017_a00','rod017_a00_1',0,0,'朴?美','п猫Ｒ','0',1,50),(320054,'ネルケ',0,'とても器用で頭が良い、俗にいう天才であった。人の傷を治療する医術に対して「魔法のようだ」と憧れをもち、医術関連書を読んで育った。物心つくころには、将来は医者になろうと決意しており、10代で優れた医術者ターゲスに師事、20歳には既に独立して医者として活躍し、その優れた医術を一度受けようと様々な地域から人が集まった。ターゲスが亡くなる時、自分が救ってやれなかったとこをとても気に病んでいる','初めまして。俺が医術師ネルケです。',2,46,0,404,0,1.5,0.85,0,'ソーサラー',0.05,0.5,0,0,3,'anm_m_rod0',2,14,20,4350,3,60,70,1,0,12,0,80,2,0,20,0,90,2,0,24,0,'0:100','400201:100','401105:55,400203:15,400204:15,400205:15',451903,501,5,2000,'rod006_a00','rod006_a00_2','bok006_a00','rod006_a00_2',0,0,'小野坂昌也','ハタリス','0',1,50),(320055,'リドーマ',0,'人にも自分にも嘘をつくのが大嫌いな、正直で誠実な子。その表情や仕草はまだまだあどけなく子供っぽいので、年上からはバカにされながらも可愛がられるタイプであった。牧場で生まれ育ったため、牧歌が得意。牧場の友達とも仲が良かった','リドーマです。お待ちしてました。',2,47,0,403,0,1.5,0.85,0,'ソーサラー',0.05,0.5,0,0,3,'anm_m_rod0',2,14,20,4350,3,60,70,1,0,12,0,80,2,0,20,0,90,2,0,24,0,'0:100','400202:100','401105:55,400203:15,400204:15,400205:15',451903,501,5,2000,'rod027_a00','rod027_a00_2','bok027_a00','rod027_a00_2',0,0,'平野文','から（辛）','0',1,50),(320056,'ペンサー',0,'かなりの集中力の持ち主で、集中することで普段感じとれないようなものが見えたり、聞こえたりする。一度落ち込むと立ち直るまでとても長い。全身に付けられるほど虫が好き','私はペンサー。聞こえるわ、世界の声が。',2,48,0,402,0,1.5,0.85,0,'ソーサラー',0.05,0.5,0,0,3,'anm_m_rod0',3,14,20,4350,3,60,70,1,0,12,0,80,2,0,20,0,90,2,0,24,0,'0:100','400301:100','401105:55,400303:15,400304:15,400305:15',451603,506,5,2000,'rod011_a01','rod011_a01_3','bok011_a01','rod011_a01_3',0,0,'久川綾','中田愛澄','0',1,50),(320057,'ミモザ',0,'うわさ話が大好きな地獄耳でスクープに目がない。フォルティスになってもその性格は健在で、他のフォルティスやその持ち主の情報を絶えず集めてはそれを広めている。あくまでウワサなので時には根も葉もないことを言い出すことも。遊び好きで女の子好きの、キザな性格','俺はミモザ。可憐な君に出会わせてくれた神様に感謝するよ。',2,49,0,401,0,1.5,0.85,0,'ソーサラー',0.05,0.5,0,0,3,'anm_m_rod0',3,14,20,4350,3,60,70,1,0,12,0,80,2,0,20,0,90,2,0,24,0,'0:100','400302:100','401105:55,400303:15,400304:15,400305:15',450503,506,5,2000,'rod029_a00','rod029_a00_3','bok029_a00','rod029_a00_3',0,0,'小野坂昌也','兎鷺','0',1,50),(320058,'チータ',0,'清楚なお嬢様。住んでいた村が男性ばかりだったため、女性の彼女は優遇されず、長年苦難に耐えてきた。どんな逆境の中でもそれに負けない強さを持っている。幼い頃から育ててくれた村長を実の親のように慕っていた','こんにちは、チータです。初めまして。',2,50,0,400,0,1.5,0.85,0,'ソーサラー',0.05,0.5,0,0,3,'anm_m_rod0',4,14,20,4350,3,60,70,1,0,12,0,80,2,0,20,0,90,3,0,24,0,'0:100','400401:100','401105:55,400403:15,400404:15,400405:15',450503,511,5,2000,'rod028_a00','rod028_a00_4','bok028_a00','rod028_a00_4',0,0,'朴?美','空中幼彩','0',1,50),(320059,'フォリウム',0,'驚くほどの幸運の持ち主。しかし、その幸運を持ってしても殺されることは防げなかった。元々の性格は勤勉実直で真面目であったが、自分を殺した相手への復讐心にとらわれている','私、フォリウム。私の目的のため一緒にいてあげるわ。',2,44,0,406,0,1.5,0.85,0,'ソーサラー',0.05,0.5,0,0,3,'anm_m_rod0',4,14,20,4350,3,60,70,1,0,12,0,80,2,0,20,0,90,2,0,24,0,'0:100','400402:100','401105:55,400403:15,400404:15,400405:15',451603,511,5,2000,'rod011_a00','rod011_a00_4','bok011_a00','rod011_a00_4',0,0,'井上喜久子','mamuru','0',1,50),(320060,'トリプス',0,'勉強熱心で、博学。「歩く百科事典」の異名を持つ物知りで、この世で知らないことはないと言われるほど。知らないということを自分自身が一番許さない自分に厳しい性格。しかし唯一恋愛には疎く、誰かを好きになる気持ちや、自分を誰かが好いてくれることに気づけない。一匹オオカミで友達がいなく、本が友人だと思っている','トリプスです。知りたいことがあったら私に聞いてください。',2,43,0,407,0,1.5,0.85,0,'ソーサラー',0.05,0.5,0,0,3,'anm_m_rod0',5,14,20,4350,3,60,70,1,0,12,0,80,2,0,20,0,90,2,0,24,0,'0:100','400501:100','401105:55,400503:15,400504:15,400505:15',450403,516,5,2000,'rod005_a00','rod005_a00_5','bok005_a00','rod005_a00_5',0,0,'三森すずこ','竹森真太郎','0',1,50),(320061,'ルドベキア',0,'正義を重んじるタイプ。面倒見がよく誰よりも人をよく見ているので、周りからも信頼されている。精神が強く簡単にはくじけない。一方で女性にはだらしなく、気に入った女性にはしばしばちょっかいを出すことも','ルドベキアだ。君の正しい選択を期待するよ。',2,42,0,408,0,1.5,0.85,0,'ソーサラー',0.05,0.5,0,0,3,'anm_m_rod0',5,14,20,4350,3,60,70,1,0,12,0,80,2,0,20,0,90,2,0,24,0,'0:100','400502:100','401105:55,400503:15,400504:15,400505:15',450503,516,5,2000,'rod018_a00','rod018_a00_5','bok018_a00','rod018_a00_5',0,0,'小野坂昌也','ゴンザレスロッキー','0',1,50),(320101,'トラデス2',0,'火スキルテスト用',NULL,2,33,0,257,0,1.5,0.85,0,'ソーサラー',0.05,0.5,0,0,3,'anm_m_rod0',1,11,1,600,3,40,50,0,0,4,0,60,1,0,8,0,70,1,0,9,0,'0:100','400101:100','400102:100',450401,0,4,10,'rod005_a01','rod005_a01_1','bok005_a01','rod005_a01_1',0,0,'斎藤千和','薫唯','0',1,0),(320102,'バラミナ2',0,'火スキルテスト用',NULL,2,33,0,257,0,1.5,0.85,0,'ソーサラー',0.05,0.5,0,0,3,'anm_m_rod0',1,11,1,600,3,40,50,0,0,4,0,60,1,0,8,0,70,1,0,9,0,'0:100','400103:100','400104:100',450401,0,4,10,'rod026_a00','rod026_a00_1','bok026_a00','rod026_a00_1',0,0,'松風雅也','はかせ','0',1,0),(320103,'リナリア2',0,'火スキルテスト用',NULL,2,33,0,257,0,1.5,0.85,0,'ソーサラー',0.05,0.5,0,0,3,'anm_m_rod0',1,11,1,600,3,40,50,0,0,4,0,60,1,0,8,0,70,1,0,9,0,'0:100','400105:100','400101:100',450401,0,4,10,'rod006_a01','rod006_a01_1','bok006_a01','rod006_a01_1',0,0,'平野文','Ixy','0',1,0),(320104,'ノイミ2',0,'水スキルテスト用',NULL,2,33,0,257,0,1.5,0.85,0,'ソーサラー',0.05,0.5,0,0,3,'anm_m_rod0',2,11,1,600,3,40,50,0,0,4,0,60,1,0,8,0,70,1,0,9,0,'0:100','400201:100','400202:100',450401,0,4,10,'rod005_a01','rod005_a01_2','bok005_a01','rod005_a01_2',0,0,'桑島法子','ゴンザレスロッキー','0',1,0),(320105,'シャクナ2',0,'水スキルテスト用',NULL,2,33,0,257,0,1.5,0.85,0,'ソーサラー',0.05,0.5,0,0,3,'anm_m_rod0',2,11,1,600,3,40,50,0,0,4,0,60,1,0,8,0,70,1,0,9,0,'0:100','400203:10