INSERT INTO `item_data` VALUES (101001,'レッドオーレ',0,'【進化合成用素材】火属性のエネルギーがかすかに溶け込んだ水晶の欠片。火の力を増幅させることができる',1,50,'2050-01-01 00:00:00'),(101002,'ブルーオーレ',0,'【進化合成用素材】水属性のエネルギーがかすかに溶け込んだ水晶の欠片。水の力を増幅させることができる',1,50,'2050-01-01 00:00:00'),(101003,'グリーンオーレ',0,'【進化合成用素材】風属性のエネルギーがかすかに溶け込んだ水晶の欠片。風の力を増幅させることができる',1,50,'2050-01-01 00:00:00'),(101004,'イエローオーレ',0,'【進化合成用素材】光属性のエネルギーがかすかに溶け込んだ水晶の欠片。光の力を増幅させることができる',1,50,'2050-01-01 00:00:00'),(101005,'パープルオーレ',0,'【進化合成用素材】闇属性のエネルギーがかすかに溶け込んだ水晶の欠片。闇の力を増幅させることができる',1,50,'2050-01-01 00:00:00'),(101006,'グレーオーレ',0,'【進化合成用素材】属性をはねのけるエネルギーが溶け込んだ水晶の欠片。属性の影響を受けずに物質を強化することができる',1,30,'2050-01-01 00:00:00'),(101007,'レインボーオーレ',0,'【進化合成用素材】全ての属性エネルギーが少しずつ溶け込んだ水晶の欠片。あらゆる力を増幅させることができる',2,0,'2050-01-01 00:00:00'),(101008,'レッドスレート',0,'【進化合成用素材】火属性の力が宿る鉱石の欠片。自然と燃え出す不思議な性質を持っている',1,100,'2050-01-01 00:00:00'),(101009,'ブルースレート',0,'【進化合成用素材】水属性の力が宿る鉱石の欠片。常に冷気を放つ不思議な性質を持っている',1,100,'2050-01-01 00:00:00'),(101010,'グリーンスレート',0,'【進化合成用素材】風属性の力が宿る鉱石の欠片。ふわふわと浮き上がる不思議な性質を持っている',1,100,'2050-01-01 00:00:00'),(101011,'イエロースレート',0,'【進化合成用素材】光属性の力が宿る鉱石の欠片。取り込んだ光を増幅して反射する不思議な性質を持っている',1,100,'2050-01-01 00:00:00'),(101012,'パープルスレート',0,'【進化合成用素材】闇属性の力が宿る鉱石の欠片。取り込んだ光を吸収してしまう不思議な性質を持っている',1,100,'2050-01-01 00:00:00'),(101013,'グレースレート',0,'【進化合成用素材】属性の力が宿りにくい鉱石の欠片。属性の力をはじき返す不思議な性質を持っている',1,100,'2050-01-01 00:00:00'),(101014,'レインボースレート',0,'【進化合成用素材】あらゆる属性の力が宿る鉱石の欠片。どんな属性の力も取り込んでしまう不思議な性質を持つ',2,0,'2050-01-01 00:00:00'),(101015,'レッドクリスタル',0,'【進化合成用素材】火属性の加護を受けた珍しい水晶の塊。炎よりも激しい赤色をしている',3,500,'2050-01-01 00:00:00'),(101016,'ブルークリスタル',0,'【進化合成用素材】水属性の加護を受けた珍しい水晶の塊。海よりも深い青色をしている',3,500,'2050-01-01 00:00:00'),(101017,'グリーンクリスタル',0,'【進化合成用素材】風属性の加護を受けた珍しい水晶の塊。草原よりも穏やかな緑色をしている',3,500,'2050-01-01 00:00:00'),(101018,'イエロークリスタル',0,'【進化合成用素材】光属性の加護を受けた珍しい水晶の塊。稲妻よりも閃く黄色をしている',3,500,'2050-01-01 00:00:00'),(101019,'パープルクリスタル',0,'【進化合成用素材】闇属性の加護を受けた珍しい水晶の塊。宵闇よりも吸い込まれそうな紫色をしている。',3,500,'2050-01-01 00:00:00'),(101020,'グレークリスタル',0,'【進化合成用素材】属性の加護を受けていない水晶の塊。白とも黒ともつかない色合いをしている',3,500,'2050-01-01 0