INSERT INTO `lang_act_tutorial_jp` VALUES (1,'操作方法','まずは操作方法について[br]説明するよ。','menu_chara_tama'),(2,'キャラクターの操作','画面左下のバーチャルキーを操作することで[br]キャラクターの移動ができるよ。[page]バーチャルキーを操作して[br]モンスターがいるところまで進んでみるきゅ！','act_tutorial_img_move1'),(3,'ワープゲート','ワープゲートが開くと[br]画面右上のミニマップに[br]『黄色いマーク』で表示されるよ。','act_tutorial_img_map1'),(4,'モンスターを倒せ！','じゃあ[br]モンスターとの戦いかたを[br]教えるきゅ！','menu_chara_tama'),(5,'攻撃','画面右下のアクションボタンをタップすることで攻撃するよ。','act_tutorial_img_attack1'),(6,'コンボ攻撃','さらに連続タップで[br]コンボ攻撃になるんだよ。[br][br]モンスターをやっつけるっきゅっ！','act_tutorial_img_combo1'),(7,'フォルティス召喚技','モンスターがたくさんいるきゅ！[page]こんなときはフォルティスを召喚して[br]まとめてやっつけよう。','menu_chara_tama'),(8,'フォルティス召喚技','画面左上のキャラクタアイコンをタップすると[br]フォルティスを[br]召喚できるんだきゅ！[page]フォルティスを召喚するにはモンスターを攻撃してゲージを貯める必要があるっきゅ。[page]今回は特別にゲージを満タンにしてあげるから、今すぐ召喚してみるきゅ！','act_tutorial_img_summon1'),(9,'フォルティス召喚技','さすがだきゅ～！[page]召喚技は連発できないから[br]ここぞというときに使うっきゅ。','menu_chara_tama'),(10,'冒険の準備','きゅきゅ！[br]僕は『たまはな』！[page]あのお方が夢に現れるなんて[br]キミはとんでもなくすごい人に違いないきゅ！[page]僕はあのお方におつかえする[br]花の精霊だきゅ！[br]あのお方のご命令でこれから[br]キミをサポートするきゅ！[page]まずは戦いに必要なフォルティスをキミにプレゼントするきゅ！','menu_chara_tama'),(11,'フォルティスGET!','どうきゅ？[br]なかなかいかしたフォルティスの宿った武器だきゅ！[page]じゃあさっそく装備して[br]冒険に出発きゅ！[br]さあ、今すぐ夢から目覚めるんだきゅ！','menu_chara_tama'),(12,'スキル','画面右下のスキルボタンを押すと[br]スキルを発動するよ。','act_tutorial_img_skill1'),(13,'属性','火属性の武器を[br]ちゃんと装備してきたきゅか？[page]ここからは風属性のモンスターが出現するから[br]属性について説明しておくきゅ。[page]モンスターや装備品には[br]属性があるんだきゅ。','menu_chara_tama'),(14,'属性','火、水、風の3つの属性は[br]3すくみの関係になっていて・・・[page]風属性のモンスターには[br]火属性の攻撃がよく効くんだきゅ。','act_tutorial_img_attr1'),(15,'光・闇　属性','光属性と闇属性はお互いに[br]有利な関係だよ。[page]闇属性の武器なら[br]光属性モンスターに与えるダメージが増えるきゅ！','act_tutorial_img_attr2'),(16,'属性','光と闇の2つの属性はお互いに有利な関係で[page]お互いに与えるダメージが[br]大きくなるっきゅ。','act_tutorial_img_attr2'),(17,'属性','実際に戦ってみると[br]わかりやすいから[br]戦ってみるきゅ！[page]まずは今まで[br]戦ったことのある[br]スティンガーっきゅ。','menu_chara_tama'),(18,'ワープゲート','あ！ワープゲートが開いたっきゅ！','menu_chara_tama'),(19,'攻撃','そうそう、いい感じきゅ。','menu_chara_tama'),(20,'杖','モンスターをタップすると[br]ロックオンすることができるよ。[page]遠距離から攻撃するときには[br]ロックオンして狙いを定めよう！','act_tutorial_img_rod4'),(21,'スキル','きゅ！？[br][br]待ち伏せされてたみたいだきゅ！[page]敵に囲まれたときには[br]スキルが大活躍っきゅ！','menu_chara_tama'),(22,'光・闇　属性','ここは光属性の神殿[br]みたいだきゅ～。','menu_chara_tama'),(23,'クリア！','さあ、ゲートに入ってクリアだっきゅ！','menu_chara_tama'),(24,'光・闇　属性','闇属性の防具も装備しておけば[br]受けるダメージも[br]減るから安心だきゅ～','act_tutorial_img_attr2'),(25,'ハンマー','ハンマーは近接攻撃が得意な武器だよ。','act_tutorial_img_hammer1'),(26,'ハンマー','コンボ中、タイミングよく[br]アクションボタンをタップすると[br]追加攻撃を行うことができるんだ。','act_tutorial_img_hammer2'),(27,'ハンマー','スキルとコンボを使い分けて、[br]敵をどんどんなぎ倒そう！','act_tutorial_img_hammer3'),(28,'杖','杖は魔法で敵を攻撃する[br]遠距離攻撃が得意な武器だよ。','act_tutorial_img_rod1'),(29,'杖','杖の中にはHPを回復する[br]ヒールスキルが[br]付いているものもあるんだ。[page]ヒールスキルは[br]近くにいる味方のHPも[br]一緒に回復できるよ。','act_tutorial_img_rod2'),(30,'杖','遠距離から味方を援護して[br]戦闘を有利に進めよう！','act_tutorial_img_rod3'),(31,'道具','画面右端の道具ボタンを[br]タップすると道具を使用するよ。[page]エクスポータルを使ってモンスターを倒してみるんだきゅ！','act_tutorial_img_useitem1'),(32,'視点切り替え','画面右端のカメラボタンを押すと[br]向いている方向にあわせて[br]視点が変わるよ。[page]カメラボタンを使いながら[br]進むっきゅ！','act_tutorial_img_camera1'),(33,'ワープゲート','ミニマップを見ながら[br]ワープゲートに入るきゅ！','act_tutorial_img_gate1'),(34,'スキル','スキルを使って[br]モンスターを倒すっきゅ！','act_tutorial_img_skill2'),(35,'思い出の場所へ','この山道を通って[br]思い出の場所へ行こう！','menu_chara_karune'),(36,'薬草を探そう','山道を進みながら薬草を[br]探しましょ！','menu_chara_karune'),(37,'どこへ向かう？','この山道には草や木に[br]群がるモンスターが[br]たくさんいるの。','menu_chara_karune'),(38,'私にも出来ること','この先には[br]神殿があるみたいだよ。[br][br]そこに向かって[br]何をするのかな？','menu_chara_karune'),(39,'視点切り替え','道が入り組んでいて[br]歩きにくいっきゅ？[page]こんなところでは[br]カメラボタンが活躍するっきゅよ。','menu_chara_tama'),(40,'タイマー','画面上部にあるタイマーは[br]クエストクリアまでの制限時間を表示しているきゅ。[page]タイマーが0になると[br]クエストは挑戦失敗になるから注意が必要だきゅ。[page]そしてクリアまでにかかった時間が短いほど、[br]タイムボーナスがたくさんもらえるきゅ。[page]敵を素早く倒してボーナスをたくさんもらうっきゅ！','act_tutorial_img_time1'),(41,'スキル','やるっきゅね～。[br][br]ちょっと教えただけで[br]できるなんて[br]筋がいいっきゅね。[page]スキルはスキルゲージが[br]満タンなら使うことができるっきゅ。','menu_chara_tama'),(43,'宝箱','スキルをうまく使えばどんどん敵を倒せるきゅ！[page]そういえば、モンスターを倒したときに[br]宝箱を拾ったみたいっきゅね。 [page]中身はクリアした後で確認するきゅ。','menu_chara_tama'),(44,'道具','バッチリだきゅ！[page]ポータルを使うときにはロックオンを忘れないでほしいっきゅ。','menu_chara_tama'),(45,'おじいさんの宝物','さぁ！[br]宝物のところまで行こう！[br][br]どんな宝物なのか[br]わくわくするね！','menu_chara_karune'),(46,'ロックオン','敵と戦うときは「ロックオン」を使うと戦いやすいっきゅ。','menu_chara_tama'),(47,'大切な約束','モンスターがたくさん[br]出てきたら、一気に[br]攻撃できるスキルや[br]アイテムを使っていこう！','menu_chara_karune'),(48,'火山温泉','温泉にはモンスターも[br]いるみたい！[br][br]モンスターの出す[br]炎のおかげで[br]熱くなってるのかな？','menu_chara_karune'),(49,'元気印','あっ！[br]ちいさなモンスターが[br]たくさん出てきたよ！','menu_chara_karune'),(50,'女王様のご用件','大事な用件って[br]なんだろうね？[br][br]女王様しか知らない[br]すっごいことなのかも！','menu_chara_karune'),(51,'プロポーズの行先','一緒に行ってほしい場所は[br]この先みたいだね','menu_chara_karune'),(52,'「守って」やる','あわわっ！[br]騒ぎを聞きつけて[br]モンスターが出てきたよ！','menu_chara_karune'),(53,'忍者の実力','忍者の力！[br]なんだかわくわくするね！','menu_chara_karune'),(54,'心配性の兄貴','臆病じゃないところ[br]見せるって、何を見せる[br]つもりなのかな？','menu_chara_karune'),(55,'噂の人','噂の人とか有名人とかに[br]会えるのって、[br]なんだかドキドキするね！','menu_chara_karune'),(56,'古の戦場','これから向かう場所って、[br]昔の戦場なのかな？','menu_chara_karune'),(57,'ハーブを求めて','私達もハーブを探して、[br]料理を作ってもらおうよ！','menu_chara_karune'),(58,'鳥を見に','さぁ！[br]鳥を見に行こう！[br][br]どんな鳥がいるのか[br]わくわくするね！','menu_chara_karune'),(59,'二人を追いかけて','どこに行くのかな？[br][br]この先に何かあるのかも','menu_chara_karune'),(60,'洞窟の奥には','ついて行くって言ったけど[br]ドラゴンになんて[br]勝てるのかな？','menu_chara_karune'),(61,'回避','戦闘のコツは[br]攻撃と「回避」をうまく[br]使い分けることだきゅ～','menu_chara_tama'),(62,'回避','回避ボタンを押すと[br]前転をして敵の攻撃を[br]よけることができるきゅ。','act_tutorial_img_dodge1'),(63,'回避','敵の攻撃を見極めて[br]回避をしてみるっきゅ！','act_tutorial_img_dodge2'),(64,'双子の勝負','この場所で勝負をする[br]みたいだね！[br]二人が出会うと、いつも[br]こんな感じなのかな？','menu_chara_karune'),(65,'見せたいもの','この先には一体[br]何があるのかな？[br]なんだか不思議な建物が[br]多いみたい。','menu_chara_karune'),(66,'理想の冒険者様','この先に冒険者が[br]いるのかな～？[br]一体どんな人[br]なんだろうね？','menu_chara_karune'),(67,'水属性','この辺りは湖に[br]囲まれてるだけあって[br]水属性のモンスターが[br]多いみたいだきゅ。','menu_chara_tama'),(68,'水属性','[blue]水属性[-]のモンスターには[br][green]風属性[-]の武器や魔法が有効だきゅ。 [page][blue]水属性[-]モンスターからの攻撃は、[green]風属性[-]の防具なら受けるダメージを減らせるきゅ。[page]装備の強化も忘れずにするっきゅよ。','act_tutorial_img_attr1'),(69,'火属性','あそこにいる「ゴブリン」は[red]火属性[-]のモンスターだっきゅ。[page][red]火属性[-]のモンスターには[br][blue]水属性[-]の装備や魔法が有効だきゅ。','act_tutorial_img_attr1'),(70,'火属性','モンスターがどんどん強くなってるから[br]防具もしっかり強化するんだきゅ！','menu_chara_tama'),(71,'闇属性','闇の力のせいか、[br]嫌な予感がするっきゅ。','menu_chara_tama'),(72,'闇属性','おさらいだけど、[br]闇属性のモンスターには[br]光属性の装備や魔法が効果的だきゅ～。','act_tutorial_img_attr2'),(73,'思い出の場所へ','この辺りには動物みたいな[br]野生のモンスターが[br]いるから、急に襲われない[br]ように周りに注意して[br]進もうね。','menu_chara_karune'),(74,'薬草を探そう','ステージの中には薬草が[br]入った宝箱が[br]隠されているみたいだよ。','menu_chara_karune'),(75,'薬草を探そう','宝箱がありそうな場所に[br]近づいて、宝箱を[br]手に入れちゃおう！[br][br]薬草よりもいいものが[br]手に入るかも！','menu_chara_karune'),(76,'どこへ向かう？','モンスターの属性に[br]注意して進んでいこう！','menu_chara_karune'),(77,'私にも出来ること','それと、この辺りは[br]水と光のモンスターが[br]出てくるみたい。[br][br]属性に注意して進もうね！','menu_chara_karune'),(78,'おじいさんの宝物','でも、気を付けて！[br][br]この先には近づいて[br]攻撃するモンスターが[br]多いよ。','menu_chara_karune'),(79,'おじいさんの宝物','うまく攻撃を回避したり、[br]遠くから攻撃して[br]進もうよ！','menu_chara_karune'),(80,'大切な約束','二人はどこへ向かうのかな？[br]この辺りには、モンスターが[br]たくさん出てくるって噂がある[br]みたいだけど。','menu_chara_karune'),(81,'火山温泉','モンスターの炎攻撃に[br]気を付けて温泉を[br]目指そう！','menu_chara_karune'),(82,'元気印','ちいさなモンスターは[br]体力が少ないみたい。[br][br]サクサク倒しちゃおう！','menu_chara_karune'),(83,'女王様のご用件','でも、この先は[br]なんだか危ない[br]みたいだよ！','menu_chara_karune'),(84,'女王様のご用件','仕掛けもモンスターも[br]たくさんあるから[br]慎重に進んでいこう！','menu_chara_karune'),(85,'プロポーズの行先','この辺は光のモンスターが[br]集合しているみたい。','menu_chara_karune'),(86,'プロポーズの行先','辛い戦いになると[br]思うけど、倒す順番を[br]考えて進んでいこう！','menu_chara_karune'),(87,'「守って」やる','囲まれちゃうと[br]大変だから、[br]うまくモンスターを分けて[br]倒そう！','menu_chara_karune'),(88,'「守って」やる','やってきたモンスター達は[br]徒党を組んでるみたい！','menu_chara_karune'),(89,'忍者の実力','この辺りのモンスターは[br]隠れるのが上手だね！[br]忍者の力試しには持って[br]来いみたい！','menu_chara_karune'),(90,'忍者の実力','急に出てくるみたいだから[br]周りに気を付けながら[br]倒していこう！','menu_chara_karune'),(91,'心配性の兄貴','この辺りは別属性の[br]モンスターが紛れ[br]込んでるみたい！[br][br]属性を見極めて[br]戦っていこう！','menu_chara_karune'),(92,'噂の人','でも、[br]待ち伏せする場所まで[br]ちょっと遠くて、色んな[br]道を通らないと[br]いけないみたい','menu_chara_karune'),(93,'噂の人','途中で出てくる[br]モンスターの属性を見て、[br]うまく対処しよう！','menu_chara_karune'),(94,'古の戦場','進むにつれて険しい地形や[br]炎を扱うモンスターが[br]増えてくるみたいだから[br]気を付けてね！[br]','menu_chara_karune'),(95,'ハーブを求めて','って、[br]いい匂いにつられて[br]モンスターが集まって[br]きたよ！','menu_chara_karune'),(96,'ハーブを求めて','スキルやアイテムを使って[br]一気にやっつけちゃおう！','menu_chara_karune'),(97,'鳥を見に','でも、気を付けて！[br]空を飛ぶモンスターが[br]近くに集まって[br]きてるみたい！','menu_chara_karune'),(98,'鳥を見に','空にいる時は[br]攻撃できないから[br]降りてきたところを[br]狙って攻撃しよう！','menu_chara_karune'),(99,'二人を追いかけて','この辺りは暑いけど、[br]だんだん涼しくなって[br]いくみたい。[br]モンスターの属性に[br]気を付けて進もう！','menu_chara_karune'),(100,'洞窟の奥には','ドラゴンを見つけたら、[br]きっと辛い戦いになると[br]思うよ！[br][br]体力やアイテムを[br]温存して進もう！','menu_chara_karune'),(101,'双子の勝負','この辺りは光属性の[br]モンスターが多く[br]出てくるみたい！[br]弱点をうまくついて[br]進みましょ！','menu_chara_karune'),(102,'見せたいもの','この辺りには、[br]魔法を使ってくる[br]モンスターがたくさん[br]出るみたい！[br]特殊防御力を上げて[br]挑もう！','menu_chara_karune'),(103,'理想の冒険者様','でも、[br]冒険者の前にモンスターが[br]たくさんいるみたい','menu_chara_karune'),(104,'理想の冒険者様','同じ姿をしたモンスターが[br]一緒に現れるみたいだから[br]囲まれないようにしながら[br]倒していこう！','menu_chara_karune'),(105,'ロックオン','モンスターをタップすると[br]そのモンスターをロックオンすることができるよ。[page]ロックオン中はそのモンスターに向って攻撃するよ。[page]目の前のモンスターをタップしてロックオンしてみよう。','act_tutorial_img_rod4'),(106,'属性','次に風属性の[br]エアロスティンガーきゅ。','menu_chara_tama'),(107,'属性','モンスターの属性は[br]HPバー横のアイコンで[br]見分けられるっきゅ。','act_tutorial_img_attr5'),(108,'属性','違いがわかったきゅ？[page]風属性モンスターに[br]有利な火属性で攻撃したら[br]簡単に倒せたはずだきゅ。','menu_chara_tama'),(109,'属性','有利な属性で攻撃できたときは[br]ダメージが黄色で表示され、[br]追加のダメージを与えることができるっきゅ。','act_tutorial_img_attr4'),(110,'属性','これからは有利な属性の[br]装備を身に着けて[br]クエストに挑戦するきゅ！[page]このあたりは風属性の[br]モンスターがいるみたいだから[page]火属性の装備を[br]身に着ければOKだきゅ！','menu_chara_tama'),(111,'道具','ロックオン成功だきゅ！[page]ついでだからロックオンして使う「道具」についても教えておくきゅ～。','menu_chara_tama'),(112,'スキル','スキルゲージはモンスターを攻撃することで貯まるっきゅ。[page]モンスターを攻撃してスキルゲージを貯めてみるんだきゅ。','act_tutorial_img_skill3'),(113,'スキル','スキルゲージは貯まったっきゅ？[br]もう一度スキルで敵をまとめて倒してみるっきゅ！','menu_chara_tama');
/*!40000 ALTER TABLE `lang_act_tutorial_jp` ENABLE KEYS */;
