DROP TABLE IF EXISTS `lang_adv_jp`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `lang_adv_jp` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `dungeon_id` int(11) DEFAULT NULL,
  `type` tinyint(4) DEFAULT NULL,
  `step` int(11) DEFAULT NULL,
  `command` int(11) DEFAULT NULL,
  `wait_tap` tinyint(4) DEFAULT NULL,
  `chara_name` varchar(16) DEFAULT NULL,
  `font_size` tinyint(4) DEFAULT NULL,
  `message` varchar(256) DEFAULT NULL,
  `texture` varchar(45) DEFAULT NULL,
  `texture_reverse` tinyint(4) DEFAULT NULL,
  `sound` varchar(45) DEFAULT NULL,
  `effect` int(10) unsigned DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `DID` (`dungeon_id`,`type`)
) ENGINE=InnoDB AUTO_INCREMENT=12851 DEFAULT CHARSET=utf8;
/*!40101 SET character_set_client = @saved_cs_client */;

