INSERT INTO `lang_seq_tutorial_jp` VALUES (1,5,'次のクエストへ進もう','おかえりだきゅ！まずはどんどんダンジョンを進めていくんだきゅ！','menu_chara_tama',12,300,'1','1010101',NULL,8),(1,10,'武器・防具を装備してみよう','まずは装備を変更してみよう！武器や防具は装備しないと意味がないんだきゅ！','menu_chara_tama',6,64,'2','300008','1',1),(1,15,'次のクエストへ進もう','さあ！ダンジョンに出発だきゅ！','menu_chara_tama',12,301,'1','1010102',NULL,0),(1,20,'薬屋に行ってみよう','ここが新しくできた薬屋さんっきゅね。入ってみるっきゅ。','menu_chara_tama',4,41,'2,2,1','200034,10000,1010103','2,50,0',5),(1,21,'薬を受け取ろう','薬の生産を完了させるんだきゅ！','menu_chara_tama',4,43,'2,22','203003','1',0),(1,22,'薬を受け取ろう','薬を受け取りにいくきゅ！','menu_chara_tama',4,43,'20',NULL,NULL,0),(1,25,'魔法屋に行ってみよう','魔法屋さんもできたみたいきゅ。今すぐ入ってみるっきゅ！','menu_chara_tama',5,51,'2,2,1','200034,10000,1010103','2,50,0',6),(1,26,'魔法を受け取ろう','魔法の生産を完了させるんだきゅ！','menu_chara_tama',5,53,'2,32','203003','1',0),(1,27,'魔法を受け取ろう','魔法を受け取りにいくんだきゅ！','menu_chara_tama',5,53,'30',NULL,NULL,0),(1,30,'道具を装備してみよう','薬や魔法アイテムも装備しないと使えないよ。冒険に行く前にしっかり装備するんだきゅ！','menu_chara_tama',6,63,'2','200001','1',1),(1,35,'次のクエストへ進もう','さあ！ダンジョンに出発だきゅ！','menu_chara_tama',12,302,'1','1010103',NULL,0),(1,40,'鍛冶屋で強化しよう','装備を強化できるのは「鍛冶屋」っきゅ。入ってみるきゅ。','menu_chara_tama',1,11,'2,1,2','10000,1010104,350001','50,0,1',2),(1,45,'次のクエストへ進もう','それじゃあ、再びダンジョンに出発きゅ！','menu_chara_tama',12,303,'6','0','10',0),(1,50,'酒場に行ってみよう','あんな巨大なモンスターを倒すなんて、もう立派な冒険者だきゅ！顔つきも一人前になってきたきゅね。[page]これからは村の酒場にちょくちょくよってみるのがいいきゅ！[page]酒場の依頼をこなすと、とても素敵な報酬がもらえるんだきゅ～。','menu_chara_tama',16,191,'1','1010105','0',7),(1,52,'ガチャの泉に行ってみよう','レアストーンがけっこうたまってきたみたいだね。色んなものが手に入るガチャの泉に行ってみよう。','menu_chara_tama',24,171,'2','210001','10',0),(1,53,'チュートリアル完了！','これで大事なことはもう一通り教え終わったっきゅ。ぼくからはもう卒業っきゅね。[page]最後におさらいっきゅ！[page]～心得その１～[page]ダンジョンから繰り返しクエストにいどむんだきゅ！[page]クエストをクリアすれば[br]EXPとお宝がもらえるからいっぱい集めるきゅ！[page]～心得その２～[page]素材が集まったら、たまには村に帰ってくるきゅ！[page]強化合成、薬の生産、魔法の生産をして次の冒険に備えるんだきゅ！[page]～心得その３～[page]行く先に困ったら、村の酒場によるんだきゅ！[page]酒場の依頼をどんどんこなして一流のフォルティシアになるんだきゅ！[page]それじゃあ、また会う日までバイバイだきゅ～！','menu_chara_tama2',0,0,'1','1010105','0',7),(1,71,'みんなで冒険に行ってみよう','ダンジョンの「みんなで冒険」からは、世界中のプレイヤーと一緒にクエストに挑めるんだきゅ。[page]みんなで冒険では、ひとりで冒険よりも多く素材がもらえるきゅ。[page]特に武具の進化や薬屋・魔法屋の施設拡張に必要な進化素材はここでしか手に入らないきゅ！[page]難易度がいろいろあるけどまずは一番簡単なクエストから挑戦してみるのがいいきゅ！','menu_chara_tama',13,121,'1,7','1010204,0','0,4',9),(1,75,'チャットメッセージを設定しよう','「みんなで冒険」中にチャットができるのは知ってたきゅ？チャットで発言する文章は自由に設定できるんだよ。','menu_chara_tama',29,0,'6','0','121',0),(1,80,'乱入とは','ダンジョンの「乱入」では他の人が始めた冒険に途中から参加できるよ。','menu_chara_tama',15,140,'6','0','121',0),(1,100,'稀霊石交換所に行ってみよう','稀霊石を手に入れたみたいだね。稀霊石を貴重なアイテムと交換できる交換所に行ってみよう。','menu_chara_tama',9,0,'2','203008','1',0),(1,200,'強化合成してみよう','敵を倒しきれない時は攻撃力や特殊攻撃力が足りないのかも。鍛冶屋の強化合成で武器の能力を上げるっきゅ。','menu_chara_tama',0,0,'11,6','0,0','0,10',0),(1,205,'強化合成してみよう','負けちゃったね……。鍛冶屋で武器や防具を強化合成してから再挑戦すれば勝てるかもしれないよ。','menu_chara_tama',0,0,'10,6','0,0','0,10',0),(1,210,'道具を使ってみよう','道具の「ポーション」は装備してるかな？まだだったらぜひ使ってみてね。ポーションがあればHPを回復できるよ。[page]薬屋さんで生産して、家で装備。これだけで準備完了だよ。','menu_chara_tama',0,0,'10,6','0,0','0,63',0),(1,215,'属性を意識しよう','どうしても勝てない時は[br]「属性」を意識してみてるんだきゅ。[page]相手に有利な属性の武器を装備していれば敵に大ダメージ。有利な属性の防具を装備していれば敵から受けるダメージを減らせるよ。','menu_chara_tama',0,0,'10,6','0,0','0,10',0),(2,1,'強化説明','ここは鍛冶屋だ。装備品の「強化合成」ができるぜ。[page]まずは強くしたい装備を選んでくれ。[page]「E」マークがついているものが現在装備している武具だから、それを選ぶことをオススメするぜ！','menu_chara_blacksmith',204,11,'2,2','10000,350001','50,1',0),(3,1,'強化説明','次に素材にするアイテムを選んでくれ！[page]素材にしたアイテムはなくなるから注意してくれよ！','menu_chara_blacksmith',28,11,'2,2,40','10000,350001,0','50,1,0',0),(4,1,'進化説明','ここでは装備品の「進化」ができるぜ。進化させた装備品は強くなるぜ！[page]ためしにサクラを進化させてみてくれ。','menu_chara_blacksmith',204,21,'2,2,2','101015,10000,300008','5,300,1',0),(6,1,'アドオン合成説明','「アドオン効果」を知ってるかい？[page]アドオン効果は装備品についていて、装備しているだけで勝手に攻撃力が上がったり防御力が上がったりする補助効果のことだぜ。[page]ここでは装備品についているアドオン効果を別の装備品に「移しかえる」ことができるのさ。[page]ものは試しだ。サクラにアドオンをつけてみてくれ！','menu_chara_blacksmith',204,31,'2,2','300008,301001','1,1',0),(7,1,'アドオン合成説明','次に素材にする装備を素材に選ぶだけだ。素材にした装備品はなくなるから注意してくれよ！[page]最後にもう一つだけ！アドオン合成は失敗することもある。合成するかはよーく考えてくれよ！[page]合成成功率を上げるためには「共鳴石」っていうアイテムを使うといい。共鳴石はＣＰで買えるぜ。[page]そうだな。「攻撃の剣」を素材にしてみてくれ！','menu_chara_blacksmith',42,31,'2,2,50','300008,301001,0','1,1,0',0),(8,0,'薬屋説明','いらっしゃいませ！[page]ここでは素材アイテムを消費して、冒険に持っていく「薬」を作れますよ。[page]さっそく薬を作ってみませんか？','menu_chara_pharmacy',200,41,'2,2','200034,10000','2,50',0),(8,5,'薬屋の施設拡張','いらっしゃいませ。あの、このお店を大きくするのを手伝っていただけませんか？[page]施設拡張をすると生産できる薬が増えてどんどん便利になっていくんですよ。','menu_chara_pharmacy',38,42,'2,2,4,21','101020,10000,0,0','1,100,8,0',0),(9,0,'魔法屋説明','いらっしゃ～い♪[page]ここでは素材アイテムを消費して、冒険に持っていく「魔法」を作れるのよ。[page]じゃあ、さっそく魔法アイテムを作ってみましょ♪','menu_chara_magic',201,51,'2,2','200034,10000','2,50',0),(9,5,'魔法屋の施設拡張','あら、このお店を大きくするのを手伝ってくれるのかしら？[page]施設拡張をすると生産できる魔法アイテムが増えてどんどん便利になっていくわよ♪','menu_chara_magic',39,52,'2,2,4,31','101020,10000,0,0','1,100,8,0',0),(10,0,'武器・防具の装備説明','これから行くダンジョンは風属性の敵がいるみたいだきゅ！[page]風属性の敵には火属性の装備が有利だよ。属性の説明はまた後でするきゅ。[page]さっそく武器を火属性のサクラに変更してみるきゅ。','menu_chara_tama',30,64,'2','300008','1',0),(10,1,'道具の装備説明','「道具装備」からアイテムを装備してみるんだきゅ。','menu_chara_tama',35,63,'2','200001','1',0),(11,0,'装備倉庫の説明','ここでは装備倉庫の中身を見たり、いらない物を売ったりできるんだきゅ。売ればフロラがもらえるっきゅよ。[page]倉庫拡張チケットかＣＰがあれば倉庫を拡張することもできるよ。[page]あと、アイコンを長押しするとアイテムの詳細を見たり、アイテムをロックしたりできるんだきゅ。ここだけじゃなく、いろんなところで長押ししてみるきゅ。','menu_chara_tama',0,0,'0','0','0',0),(12,0,'道具倉庫の説明','ここではアイテム倉庫の中身を見たり、いらない物を売ったりできるんだきゅ。売ればフロラがもらえるっきゅよ。[page]あと、アイコンを長押しするとアイテムの詳細が見られるきゅ。ここだけじゃなく、いろんなところで長押ししてみてね。[page]詳細では所持しているアイテムの個数も見られるからぜひ活用してみるんだきゅ。','menu_chara_tama',0,0,'0','0','0',0),(13,0,'稀霊石交換所の説明','ここは稀霊石を品物と交換する場所よ。[page]稀霊石はレアな武器や防具を売ったり合成素材にしたりすると手に入れることができるから、少しずつ集めていってね。','menu_chara_material',0,0,'2','203008','1',NULL),(14,0,'イベント交換所の説明','ここはイベントが開催されているときに開くお店よ。イベントで手に入るアイテムを集めて、好きな品物と交換できるの。','menu_chara_material',0,0,'0','0','0',NULL),(15,0,'イベント受取所の説明','ここはイベントが開催されているときに開くお店よ。イベントで特定のアイテムを集めるたびに、品物がもらえるの。','menu_chara_material',0,0,'0','0','0',NULL),(16,0,'ガチャの説明','ここはガチャの泉！いろんなアイテムが手に入るからワクワクするっきゅね～。[page]ＣＰやレアストーンがあれば、レアガチャができるっきゅ！[page]レアガチャの「フォルティスガチャ」は良い武器、「防具ガチャ」は良い防具が手に入るっきゅ！[page]レアストーンはダンジョンのタイムボーナスや、ミッションなどでもらえるんだきゅ！いっぱい集めようっきゅ！[page]あと、冒険すると手に入るガチャＰがあれば、「ノーマルガチャ」がひけるんだきゅ。[page]「ノーマルガチャ」は、冒険に便利な道具が手に入るんだきゅ。[page]今はレアストーンがたまってるから「フォルティスガチャ」か「防具ガチャ」をやってみるきゅ！','menu_chara_tama',0,171,'2','210001','10',0),(17,1,'ミッションの説明','これからはミッションを達成して報酬をどんどん貰おうね。[page]日ごとに変わるデイリーミッションもあるから、ここに毎日立ち寄ってみるといいきゅ！[page]巨大モンスターを倒した記念にさっそくぼくから報酬をあげるっきゅ！','menu_chara_tama',206,191,'0','0','0',0),(18,0,'フレンドの説明','ここではこれまでにできたフレンドの確認、フレンドとのチャット、フレンド申請や承認ができるきゅ！','menu_chara_tama',0,0,'0','0','0',NULL),(19,0,'ショップの説明','ここはショップだよ。CPで便利なアイテムがいろいろ買えるんだきゅ～。','menu_chara_tama',0,0,NULL,NULL,NULL,NULL),(20,0,'ダンジョンリザルトの説明','ここでは今回のプレイ結果が見られるよ。[page]「タイムボーナス」「獲得した経験値」「獲得したフロラ」が確認できるよ。[page]タイムボーナスはクリアまでにかかった時間で決まるきゅ。[page]かかった時間が少ないほどタイムボーナスをたくさん獲得できるよ。[page]タイムボーナスが一定に達すると素敵なアイテムがもらえるから、何度も繰り返し同じダンジョンをプレイしてみるきゅ！','menu_chara_tama',0,0,NULL,NULL,NULL,0),(21,10,'次のクエストへ進もう','初めての戦闘、うまくいったっきゅね！すごいきゅ！[page]あらためて自己紹介するっきゅ。[br]ぼくは「たまはな」！花の精霊だきゅ！[page]いきなり現れては冒険者のお手伝いをするのがお仕事なんだきゅ！クールっきゅね～[page]さあ、どんどん先に進むんだきゅ！冒険はまだまだ始まったばかりだきゅ！','menu_chara_tama',12,0,'1','1010101',NULL,8),(21,11,'次のクエストへ進もう',NULL,'menu_chara_tama',12,300,'1','1010101',NULL,8),(21,15,'武器・防具を装備してみよう','いいフォルティスの宿った武器を手に入れたみたいっきゅね！家に戻って装備してみるきゅ！','menu_chara_tama',101,64,'1,2','1010102,300008','0,1',2),(21,16,'次のクエストへ進もう',NULL,'menu_chara_tama',12,301,'1','1010102',NULL,0),(21,20,'薬屋に行ってみよう','あ！村で新しいお店がオープンしたみたいだきゅ！[page]さっそく行ってみるきゅ！','menu_chara_tama',101,41,'1,2,2','1010103,200034,10000','0,2,50',5),(21,21,'薬を受け取ろう','村で作ってもらってた生産品ができたみたいだきゅ！受け取りに行くんだきゅ！','menu_chara_tama',101,43,'20',NULL,NULL,0),(21,30,'魔法屋に行ってみよう','村でまた新しいお店がオープンしたみたいだきゅ！行ってみるきゅ！','menu_chara_tama',101,51,'1,2,2','1010103,200034,10000','0,2,50',6),(21,31,'魔法を受け取ろう','村で作ってもらってた生産品ができたみたいだきゅ！受け取りに行くんだきゅ！','menu_chara_tama',101,53,'30',NULL,NULL,0),(21,35,'次のクエストへ進もう',NULL,'menu_chara_tama',12,302,'1','1010103',NULL,0),(21,50,'鍛冶屋で強化しよう','村で装備を強化ができるようになったみたいだきゅ！[page]さっそく行ってみるきゅ。','menu_chara_tama',101,10,'1','1010104',NULL,2),(21,55,'次のクエストへ進もう',NULL,'menu_chara_tama',12,303,'1','1010104',NULL,0),(21,70,'みんなで冒険に行ってみよう','むむっ！いよいよ「みんなで冒険」に行ける強さになったみたいっきゅね！いったん村に戻るんだきゅ！','menu_chara_tama',101,121,'1,7','1010204,0','0,4',0),(22,100,'ブーストアイテム説明','ブーストアイテムを手に入れたみたいだね。[page]ブーストアイテムを使うとダンジョンでもらえる報酬を増やすことができるんだきゅ！[page]みんなで冒険の時は、誰かがブーストアイテムを使っていると全員に効果があるんだよ。[page]ブーストアイテムの効果は重ねがけできないから気をつけてね。','menu_chara_tama',100,0,'2','202004','1',0),(100,0,'強化完了','武具が強くなったぜ！[page]これからもこまめに強化合成をして、どんどん強くしていってくれよ！[page]お帰りかい？それなら戻るボタンを押してくれ。','menu_chara_blacksmith',0,0,NULL,NULL,NULL,0),(101,0,'進化完了','どうだい？進化させると、ただ強くなるだけじゃないんだ。[page]より長く強化合成できるようになる上に、アドオン効果も多くつけられるようになるぜ。[page]これからも進化できそうなものがあれば迷わず進化させてくれ！[page]村に帰るなら戻るボタンを押してくれ。また来てくれよ！','menu_chara_blacksmith',0,0,NULL,NULL,NULL,NULL),(103,1,'生産完了',NULL,'menu_chara_pharmacy',40,43,'20',NULL,NULL,0),(103,5,'生産完了','ご注文ありがとうございます！[page]生産には時間がかかりますけど、妖精さんを使えばすぐに生産完了できますよ。[page]今回は特別に妖精さんをプレゼントしますので試してみてくださいね。','menu_chara_pharmacy',40,43,NULL,NULL,NULL,0),(104,1,'生産完了',NULL,'menu_chara_magic',0,53,'30',NULL,NULL,0),(104,4,'生産完了','ご注文ありがとう♪一定時間が経ったら魔法は完成するわよ。[page]妖精さんを使うことで、すぐに生産完了にもできるから、今回は試しに使ってみてね。','menu_chara_magic',40,53,'2','203003','1',0),(104,5,'生産完了','ご注文ありがとう♪一定時間が経ったらまた取りに来てね。[page]お帰りなら戻るボタンを押してねん♪','menu_chara_magic',0,53,NULL,NULL,NULL,0),(105,0,'装備完了','これで準備完了だね。戻るボタンを押して外に出るんだきゅ！','menu_chara_tama',0,0,'6',NULL,'64',0),(106,0,'装備完了','これで冒険中も安心だね。道具はしっかり使いどころを考えるんだきゅ！[page]じゃあ、戻るボタンから外に出るんだきゅ！','menu_chara_tama',0,0,NULL,NULL,NULL,0),(107,0,'受取完了','これで当店のご説明は終了です。ありがとうございました。[page]お帰りなら戻るボタンを押してください。またのご来店をお待ちしています。','menu_chara_pharmacy',0,0,NULL,NULL,NULL,0),(108,0,'受取完了','これで生産から受け取りまでの流れはマスターできたかしら？[page]それじゃ、またのご来店を待ってるわね♪お帰りは戻るボタンからよ。','menu_chara_magic',0,0,NULL,NULL,NULL,0),(109,0,'武器を変更しよう',NULL,NULL,202,64,'2','300008','1',0),(110,0,'アイテムを装備しよう',NULL,NULL,203,63,'2','200001','1',0),(111,0,'強化説明',NULL,NULL,205,11,'2,2','350001,10000','1,50',0);
