INSERT INTO `loading_tips` VALUES (1,0,0,0,'フォルティスとは？','命を落とした人間が霊となり武器に宿る[br]それが[ColorImportant]『フォルティス』…[-]',NULL),(2,0,0,0,'コンボを出そう！','アクションボタンを連続でタップすると[br]『コンボ（連続技）』が出せる。[br]コンボの最後は与えるダメージが少し大きいぞ！',NULL),(3,0,0,0,'フォルティスを召喚しよう！','ピンチの時は『フォルティス召喚』！[br]画面左上のフォルティスアイコンが光ったら、タップしてフォルティスを呼び出せ！',NULL),(4,0,0,0,'フォルティスを召喚するには？','フォルティスを召喚するためには「召喚パワー」が[br]必要。[br]召喚パワーは敵を攻撃したり、ダメージを受けたりすることでじょじょにたまっていく。',NULL),(5,0,0,0,'属性を意識しよう！','属性は風水火光闇の５種類。[br]「風は水に強い」などの関係性がある。[br]強い敵と戦うときは属性的に有利な武器・防具をそろえていこう！','TipsImg_13'),(6,0,0,0,'鎧と兜も強化しよう！','武器だけでなく鎧や兜などの防具も強化していこう！[br]敵から受けるダメージが減り、死ににくくなるぞ！',NULL),(7,0,0,0,'アドオン効果とは？','装備には『アドオン効果』がついてるものがある。[br]装備画面→装備品アイコンを長押しでどんなアドオン効果がついているか確認しよう！',NULL),(8,0,0,0,'リングとアミュレットも忘れずに','リングには攻撃系、アミュレットには防御系のアドオン効果がついている。[br]「みんなで冒険」に行って、より効果の大きいものを手に入れよう！',NULL),(9,0,0,0,'ダメージ数値の色に注目！','敵を攻撃したときに有利属性だとダメージ数値が黄色で表示される。青だと不利属性。おぼえておこう！',NULL),(11,0,0,0,'みんなで冒険','「みんなで冒険」は「ひとりで冒険」よりも良い報酬が入手できるらしい。',NULL),(13,0,0,0,'他プレイヤーは頼もしい味方','「ひとりで冒険」では他のプレイヤーを[br]助っ人として連れていける。[br]フレンドを連れて行くとガチャＰが多めにもらえるぞ！',NULL),(14,0,0,0,'クエストで見かけるスイッチ','スイッチを踏むといろんなことが起きる。[br]電磁柵はスイッチを踏んで解除しよう！[br]敵が出てくるスイッチもあるので注意！',NULL),(15,0,0,0,'クエストはクリアスピードが大事！','クエストは速くクリアするほど多くのスピードボーナスがもらえ「お宝ゲージ」のたまりも速い！[br]速くクリアしてお宝をゲットしよう！',NULL),(16,0,0,0,'ワープゲートの色に注意！','オレンジ色のワープゲートはワープした先に巨大な敵が待ち受けている！[br]しっかり準備してからワープしよう！',NULL),(18,0,0,0,'「乱入」で素早く合流','他のプレイヤーのクエストに素早く合流したいときは[br]「ダンジョン」を選び「乱入」しよう！',NULL),(19,0,0,0,'チャットでお話しよう！','画面中央下部のボタンはチャットボタン。[br]テキストチャットで他のプレイヤーとコミュニケーションしながら戦っていこう！','TipsImg_28'),(20,0,0,0,'オートワードで個性を発揮！','『オートワード』は、状況に応じて自動的にチャットメッセージを発する機能のこと。[br]「みんなで冒険」ではオートワードで個性を出そう！[br][br]（メニューから「メッセージ設定」で設定可能）',NULL),(21,0,0,0,'プリセットワードを設定しておこう','「みんなで冒険」でよく使うチャットテキストは、[br]『プリセットワード』にあらかじめ登録しておくと[br]便利！[br][br]（メニューから「メッセージ設定」で設定可能）',NULL),(22,0,0,0,'『ガチャＰ』あつめよう！（１）','他のプレイヤーの助っ人として自分のプレイヤーが使用されるとガチャＰがもらえる！',NULL),(23,0,0,0,'『ガチャＰ』あつめよう！（２）',' 「ひとりで冒険」で他プレイヤーを連れて行くと自分にもガチャＰが付与される！',NULL),(24,0,0,0,'『ガチャＰ』あつめよう！（３）','「みんなで冒険」で他のプレイヤーと冒険した後、[br]「グッド！」したりされたりするとガチャＰ獲得！',NULL),(25,0,0,0,'レアストーンをあつめよう！','『レアストーン』をあつめれば「レアなガチャ泉」で[br]ガチャがひける！[br]すごいフォルティスが入手できるかも！？',NULL),(43,0,0,0,'他のプレイヤーに感謝のグッドを！','「みんなで冒険」した後は、『グッド！』ボタンをタップして感謝の気持ちを伝えたりお互いの活躍を褒め称えよう！',NULL),(44,0,0,0,'アイコン長押しで詳細表示','フォルティスアイコンや各種報酬アイコン…[br]長押しすると詳細を確認することができる。[br]いろんなアイコンを長押ししてみよう！',NULL),(45,0,0,0,'カメラ操作方法変更','カメラ操作は「オート」と「マニュアル」の２種類。[br]村画面のメニューから「操作方法設定」で変更しよう！',NULL),(46,0,0,0,'使おう！ブーストアイテム','ブーストアイテムを使って、ダンジョンでもらえる経験値やフロラをブーストしよう！',NULL),(47,0,0,0,'ブーストアイテムはみんながお得','ブーストアイテムの効果は、同じダンジョンにいるみんなに効果がある。',NULL),(48,0,0,0,'スキルを使いこなせ！','武器には１～２つのスキルがついている。[br]スキルを使いこなして効率よく敵を倒していこう！',NULL),(49,0,0,0,'スキルパワーをためよう！','スキルボタンが緑色の光で満ちた時にスキルを使用できる。光は敵に攻撃を当てることで増えていく。',NULL),(60,0,0,0,'デイリーミッションも忘れずに','日ごとに変わる『デイリーミッション』[br]クリアすればお得なアイテムがもらえるかも！？[br]酒場を毎日確認しよう！',NULL),(61,0,0,0,'能力アップドリンク','プレイヤーの能力を一時的に高める『パワードリンク』と『ガードドリンク』[br]冒険に行き詰まったら薬屋で生産して使ってみよう！',NULL),(62,0,0,0,'敵タップロックオンを使いこなそう','敵をタップすることでロックオンが可能！[br]その敵中心の動きになるので、敵を見失いたくない時に便利！',NULL),(63,0,0,0,'お得なスペシャルクエスト','フロラがほしい時[br]　　→「ゴールドイノブタラッシュ」をねらえ！[br]強化合成素材がほしい時[br]　　→「シルバーイノブタラッシュ」をねらえ！',NULL),(64,0,0,0,'特殊攻撃力と特殊防御力','「特殊攻撃力」…高いほどスキル技が強力になる！[br]「特殊防御力」…高いほど敵の特殊攻撃を無効化！',NULL),(65,0,0,0,'武器の種類','武器は「両手剣」「ハンマー」「杖」の3種類。いろいろ試して自分好みの武器をみつけよう！',NULL),(66,0,0,0,'「両手剣」の特徴','「両手剣」はコンボの段数も多く使いやすい標準的な[br]武器だ。',NULL),(67,0,0,0,'「ハンマー」の特徴','「ハンマー」は一発の威力が大きい。スキルをうまく使えばさらに威力アップ！',NULL),(68,0,0,0,'「杖」の特徴','「杖」は魔法スキルが高威力！回復系のスキルがついてるものも。',NULL);
