INSERT INTO `mission` VALUES (610001,1001,0,5,'君の物語','イニティ平原をクリアする','たまはな','一人前のフォルティシアになるために、まずは基本的な心得をひととおり覚えるきゅ！それができたら、ぼくから報酬をあげるきゅよ～！','これからはこの酒場で村の人たちの依頼をこなしていくんだきゅ！依頼を受けることで新たに開くお店もあるからひんぱんに立ち寄って依頼をこなすんだきゅ！','報酬を受け取る',1,999,0,'2010-01-01 00:00:00','2100-01-01 00:00:00',0,0,0,4,1010101,1,210001,6,0),(610004,0,0,5,'旅は道連れ','みんなで冒険を1回クリア','傭兵隊長テムジナ','私はテムジナ。冒険者を集めてモンスターの討伐を指揮している者だ。君も他の冒険者と一緒にモンスター討伐してみないか？武具の進化や、薬屋・魔法屋の拡張に必要な素材も取れるぞ。','うむ。なかなかうまくいったようだな。これは今回の報酬だ。どうか受け取ってくれたまえ。','討伐報告',1,999,610001,'2010-01-01 00:00:00','2100-01-01 00:00:00',0,0,0,3,99904,1,202004,1,9),(610005,0,0,4,'初々しい冒険者','プレイヤーLvを5にする','酒場店主ジョニー','よお。あんた、初めてのお客さんだな。俺はここの店主ジョニーだ。一流の冒険者を応援するのが俺の趣味さ。あんた、見込みがありそうだな。少し成長したらまたここに顔を出しな。','ほう……。少しは成長したようだな。だが、一流の冒険者への道は険しい。これからもっと精進して俺を驚かせてくれよ。期待してるぞ！','成長を見せる',1,999,610001,'2010-01-01 00:00:00','2100-01-01 00:00:00',0,0,0,1,1,5,10000,300,0),(610006,0,0,4,'駆け出し冒険者','プレイヤーLvを10にする','酒場店主ジョニー','ようこそ、駆け出しの冒険者さん。あれから修行を続けてるかい？もっと成長した姿、また俺に見せてくれよ。','ちゃんと成長してるじゃねえか。あんたの成長を見るのが楽しみになってきたよ。さらなる活躍を期待してるぞ！','成長を見せる',1,999,610005,'2010-01-01 00:00:00','2100-01-01 00:00:00',0,0,0,1,1,10,203001,1,0),(610007,0,0,4,'ひたむきな冒険者','プレイヤーLvを15にする','酒場店主ジョニー','調子はどうだい？一流の冒険者目指して日々精進あるのみだ。頑張ってくれよ！','しっかりと強くなって帰ってきたようだな。あんた、タダモンじゃないかもな。一流の冒険者ってのは簡単になれるもんじゃない。だが、諦めなければ必ず道は開けるぞ！','成長を見せる',1,999,610006,'2010-01-01 00:00:00','2100-01-01 00:00:00',0,0,0,1,1,15,203001,1,0),(610008,0,0,4,'いっぱしの冒険者','プレイヤーLvを20にする','酒場店主ジョニー','いっぱしの顔つきになってきたじゃねえか。だが、強い奴ってのは世界にたくさんいるぜ。そいつらを追いこすくらいの成長を俺に見せつけてくれ！','かなり成長したようだな。あんた、戦士としての風格が出てきたぜ。これからも応援させてくれよ！','成長を見せる',1,999,610007,'2010-01-01 00:00:00','2100-01-01 00:00:00',0,0,0,1,1,20,203005,1,0),(610009,0,0,4,'有望な冒険者','プレイヤーLvを25にする','酒場店主ジョニー','もう冒険にはだいぶ慣れたかい？だが気を抜くなよ。あんたはもっともっと強くなれるはずだ。それを証明してみせてくれ！','さらに強くなったな。あんたに才能を感じるぜ。こうなったらどこまでいけるかしっかりと見届けさせてもらうぞ！','成長を見せる',1,999,610008,'2010-01-01 00:00:00','2100-01-01 00:00:00',0,0,0,1,1,25,203005,1,0),(610010,0,0,4,'育ちざかりの冒険者','プレイヤーLvを30にする','酒場店主ジョニー','さあ、今回はどれだけの成長を俺に見せてくれるんだい？どんどん強くなっていくあんたを見てると、若いころの自分を思い出して嬉しくなってくるぜ！','お見事だ！確実に強くなってるな！こりゃあ若いころの俺なんてすぐに追い越されちまうかもなあ！','成長を見せる',1,999,610009,'2010-01-01 00:00:00','2100-01-01 00:00:00',0,0,0,1,1,30,203005,1,0),(610011,0,0,4,'期待の冒険者','プレイヤーLvを35にする','酒場店主ジョニー','あんたの成長を見ているのが楽しくて仕方ないぜ！今度もまた大きく育って帰ってきてくれるんだろう？頼むぞ！','期待を裏切らない成長っぷりだな！強さだけじゃなく、戦い方もだいぶ成長したんじゃないか？さらなる飛躍が楽しみだ！','成長を見せる',1,999,610010,'2010-01-01 00:00:00','2100-01-01 00:00:00',0,0,0,1,1,35,203005,1,0),(610012,0,0,4,'たくましい冒険者','プレイヤーLvを40にする','酒場店主ジョニー','肉体だけじゃなく、精神もきたえてこそ一流の冒険者だ。身も心も大きく成長して帰ってきてくれよ！','見た目にもだいぶたくましくなってきたじゃねえか！最強への道のりは険しいが、あんたなら間違いなく行ける気がしてきたぜ！','成長を見せる',1,999,610011,'2010-01-01 00:00:00','2100-01-01 00:00:00',0,0,0,1,1,40,203005,1,0),(610013,0,0,4,'高みを目指す冒険者','プレイヤーLvを45にする','酒場店主ジョニー','ひたすら強くなっていくあんたを見てるとシビれるねえ。まだまだ高みを目指すんだろう？その雄姿を俺に拝ませてくれ！','あんたから力を感じるぜ。初めてここに来た時とは比べ物にならないほど成長したな！一流まで、あと一歩だ！','成長を見せる',1,999,610012,'2010-01-01 00:00:00','2100-01-01 00:00:00',0,0,0,1,1,45,203005,1,0),(610014,0,0,4,'一流冒険者','プレイヤーLvを50にする','酒場店主ジョニー','いよいよ一流の冒険者ってやつに近づいてきたようだな。もう俺から言うことはねえ！最高に成長したあんたの姿、俺に見せてくれよ！','たまげたぜ！こいつはすげえ戦士がこの村から誕生したようだな！あんたの成長を見届けることができて俺は幸せ者だぜ！ありがとな！','成長を見せる',1,999,610013,'2010-01-01 00:00:00','2100-01-01 00:00:00',0,0,0,1,1,50,203005,1,0),(610015,0,0,2,'友達自慢','フレンドを5人作る','ひょうきん少年ジロー','ねえねえ、ボク、たくさん友達いるんだ。すごいでしょ！よかったら友達の数を自慢しあわない？でも、最低５人は友達作ってから来てよね。','ふーん。まあまあ友達いるんだね。でも僕の方が多いね。これあげるから、気を落とさないでね。','友達を教える',1,999,610001,'2010-01-01 00:00:00','2100-01-01 00:00:00',0,0,0,7,0,5,203007,1,0),(610016,0,0,2,'友達大自慢','フレンドを10人作る','ひょうきん少年ジロー','また友達の数で勝負しない？ただし、前よりもっと友達作ってから来てよね！','ふーん。ま、まあ、それなりに友達いるんじゃないかな？でも僕の方が友達多いね。これあげるから、気を落とさないで！','友達を教える',1,999,610015,'2010-01-01 00:00:00','2100-01-01 00:00:00',0,0,0,7,0,10,203007,1,0),(610017,0,0,2,'友達超自慢','フレンドを20人作る','ひょうきん少年ジロー','また友達の数で勝負しない？ただし、前よりもっともっと友達作ってから来てよね！','うっ……。そ、そんなに友達できたの？ぼ、ぼくの負けだよ。まさか負けるなんて。たくさん人を紹介してくれたお礼にこれあげるよ。','友達を教える',1,999,610016,'2010-01-01 00:00:00','2100-01-01 00:00:00',0,0,0,7,0,20,210001,2,0),(610019,0,0,1,'新しい薬です','薬屋の施設Lvを2にする','薬屋カンナ','お店を大きくしようと思っているのですが、お手伝いしていただける方はいらっしゃいませんでしょうか？お願いします。','本当にありがとうございました！これからもお店をよろしくお願いいたしますね。','報告する',1,999,610061,'2010-01-01 00:00:00','2100-01-01 00:00:00',0,0,0,1,100,2,203003,1,0),(610020,0,0,1,'薬屋拡張計画です','薬屋の施設Lvを5にする','薬屋カンナ','前回はありがとうございました。実はまた薬屋の拡張計画をしているんですが、今回もお手伝いいただけませんか？','あなたのおかげで計画は成功です。ありがとうございました！とっても助かりました。','報告する',1,999,610019,'2010-01-01 00:00:00','2100-01-01 00:00:00',0,0,0,1,100,5,203003,1,0),(610021,0,0,1,'薬屋の大規模計画です','薬屋の施設Lvを10にする','薬屋カンナ','お店の拡張計画も最終段階です！お手すきの際に手伝っていただけると助かります。よろしくお願いします。','すごい！開店時よりお店がすごく大きくなりましたよ！本当に本当にありがとうございました！','報告する',1,999,610020,'2010-01-01 00:00:00','2100-01-01 00:00:00',0,0,0,1,100,10,203003,2,0),(610025,0,0,1,'新しい魔法♪','魔法屋の施設Lvを2にする','魔法屋ジェニファー','そろそろお店を拡張しようと思っているんだけど、誰か手伝ってくれわいかしら。お礼はもちろんするわよ♪','ありがとう。おかげで助かっちゃったわ。またよろしくねえん♪','報告する',1,999,610061,'2010-01-01 00:00:00','2100-01-01 00:00:00',0,0,0,1,120,2,203004,1,0),(610026,0,0,1,'魔法屋拡張計画♪','魔法屋の施設Lvを5にする','魔法屋ジェニファー','お店をどんどん大きくするわよーん♪今回も少しお手伝いいただけるかしら？','今回も手伝ってくれてありがとう。またよろしくね♪','報告する',1,999,610025,'2010-01-01 00:00:00','2100-01-01 00:00:00',0,0,0,1,120,5,203003,1,0),(610028,0,0,1,'魔法屋の大規模計画♪','魔法屋の施設Lvを10にする','魔法屋ジェニファー','お店の拡大計画もいよいよ大詰めよ。さあ、一気にお店を大きくするわよーん♪','これでお店の拡張もひと段落ね♪おかげですごくお店が大きくなったわ。どうもありがとう♪','報告する',1,999,610026,'2010-01-01 00:00:00','2100-01-01 00:00:00',0,0,0,1,120,10,203003,2,0),(610030,0,0,6,'強化しまくるぜ！','強化合成を5回する','鍛冶屋ミスミ','強化合成はやればやるほど武具が強くなっていくんだぜ！ぜひ体験してみてくれ！','ずいぶん強化合成に慣れてきたみたいだな！これからもウチの店をよろしくな！心ばかりのプレゼントをやるぜ！','報告する',1,999,610001,'2010-01-01 00:00:00','2100-01-01 00:00:00',0,0,0,1,320,5,101015,5,0),(610031,0,0,6,'強化大成功するぜ！','強化大成功を1回する','鍛冶屋ミスミ','俺の調子がいい時は武具の強化合成で大成功するぜ。ぜひうちの鍛冶屋に来て体験してみてくれ！','やっぱり大成功すると気分がいいな！体験させてくれたお礼にこれをやるぜ！','報告する',1,999,610030,'2010-01-01 00:00:00','2100-01-01 00:00:00',0,0,0,1,321,1,210001,1,0),(610032,0,0,6,'進化するぜ！','進化合成を1回する','鍛冶屋ミスミ','ウチの鍛冶屋で武具の進化ができるようになったぜ！ぜひやってみてくれ！','進化の効き目はバツグンだろう？これからもウチの店をよろしくな！心ばかりのプレゼントをやるぜ！','報告する',1,999,610030,'2010-01-01 00:00:00','2100-01-01 00:00:00',0,0,0,1,330,1,301001,1,3),(610033,0,0,6,'アドオン合成するぜ！','アドオン合成を1回する','鍛冶屋ミスミ','ウチの鍛冶屋で武具のアドオン合成ができるようになったぜ！ぜひやってみてくれ！','アドオン合成、かなりイカすだろう？これからもウチの店をよろしくな！心ばかりのプレゼントをやるぜ！','報告する',1,999,610032,'2010-01-01 00:00:00','2100-01-01 00:00:00',0,0,0,1,340,1,203002,1,4),(610034,0,0,6,'鍛冶屋マスターだぜ！','アドオン合成を5回する','鍛冶屋ミスミ','あんた、まだまだアドオン合成を使いこなせていないって感じだな！ウチで慣れるまで何度もやってみてくれよ！','アドオン合成のやり方がサマになってきたじゃねえか！これでもう教えることは何もねえな！','報告する',1,999,610033,'2010-01-01 00:00:00','2100-01-01 00:00:00',0,0,0,1,340,5,203002,1,0),(610035,0,0,5,'アウラ山道突破','ひとりで冒険　風に育まれし者　をクリア','冒険青年サムLv.2','うう……。アウラ山道の出口に巨大な敵がいて先に行けないよう。やっつけてくれる人が来るまで待とう……。','ええっ！あの木の化け物を倒してくれたんですか！？ど、どうもありがとう！このお礼を受け取ってください！','報告する',1,999,610060,'2010-01-01 00:00:00','2100-01-01 00:00:00',0,0,0,4,1010207,1,210001,2,0),(610036,0,0,5,'クラルス湖突破','ひとりで冒険　水の流れの如く　をクリア','冒険青年サムLv.3','クラルス湖に来たのはいいけど、ここもモンスターが強くて恐ろしいよう……。誰か助けてくれる人はいないかなぁ……。','あのクラルス湖の敵を討伐してくれたんですか！？す、すごい！これはお礼です、受け取ってください！','報告する',1,999,610035,'2010-01-01 00:00:00','2100-01-01 00:00:00',0,0,0,4,1010305,1,210001,2,0),(610037,0,0,5,'ルーベル火山突破','ひとりで冒険　長い洞窟　をクリア','冒険青年サムLv.5','あ、熱いっ！ルーベル火山のモンスターの攻撃がすごくて先に進めないっ！だ、誰かモンスターを退治しておくれよう！','またあなたがモンスターを退治しくれたんですか！？ありがとうございます！こ、これはお礼です。受け取ってください！','報告する',1,999,610036,'2010-01-01 00:00:00','2100-01-01 00:00:00',0,0,0,4,1010405,1,210001,2,0),(610038,0,0,5,'アイテール神殿突破','ひとりで冒険　神聖な獣　をクリア','冒険青年サムLv.10','アイテール神殿、悔しいけど僕の力じゃ突破できないみたいだ……。誰かの力を借りて先に進まなきゃいけなそうだよ……。','僕が仲間を探している間にモンスターを討伐してくれたていたなんて……。あなたは本当にすごい冒険者ですね。これはお礼です。どうか受け取ってください！','報告する',1,999,610037,'2010-01-01 00:00:00','2100-01-01 00:00:00',0,0,0,4,1010504,1,210001,2,0),(610039,0,0,5,'ニゲル迷宮突破','ひとりで冒険　廃墟の悪魔　をクリア','冒険青年サムLv.15','僕も少しは成長しているはずなのに、ニゲル迷宮の敵はこれまでよりさらに強くなってるみたいだ……。僕の力じゃ越えられないのか？','ニゲル迷宮を突破したんですか！？すごい！あなたを目標に僕も頑張ります！これはお礼です。どうか受け取ってください！','報告する',1,999,610038,'2010-01-01 00:00:00','2100-01-01 00:00:00',0,0,0,4,1010604,1,210001,2,0),(610040,0,0,5,'ノヴァ旧跡突破','ひとりで冒険　獣、召喚　をクリア','冒険青年サムLv.20','ノヴァ旧跡、まさか最後にあんな強敵がいるなんて……。あと少しで越えられそうだったのに……悔しいな。','あの化け物を倒すなんて、あなたはやっぱり本物だ！でも次こそは僕自身の力で越えて見せますよ！','報告する',1,999,610039,'2010-01-01 00:00:00','2100-01-01 00:00:00',0,0,0,4,1010704,1,210001,2,0),(610041,0,0,5,'ウィリデ森林突破','ひとりで冒険　森の番人　をクリア','冒険青年サムLv.25','ウィリデ森林、もう少し修行してから行けば僕にも踏破できそうですね。どちらが先にあの森を抜けられるか競争しませんか？','どうやらあと一歩のところであなたに先を越されてしまったようですね。さすがです。でもちょっと悔しいな。次は負けませんよ！','報告する',1,999,610040,'2010-01-01 00:00:00','2100-01-01 00:00:00',0,0,0,4,1020104,1,210001,2,0),(610042,0,0,5,'アルゲオ渓谷突破','ひとりで冒険　荒ぶる氷の龍　をクリア','冒険青年サムLv.30','だんだん敵が強くなってきたみたいですね。でも、アルゲオ渓谷を先に越えるのは僕です。今度は負けませんよ！','もうアルゲオ渓谷を抜けたんですか！？僕の力はまだまだあなたには及ばないってことですね……。参りました。','報告する',1,999,610041,'2010-01-01 00:00:00','2100-01-01 00:00:00',0,0,0,4,1020204,1,210001,2,0),(610043,0,0,5,'ミネラ洞窟突破','ひとりで冒険　火を吐く竜　をクリア','冒険青年サムLv.35','いつもあなたに先を越されてきたけど、今回こそは先に行かせてもらうよ！ミネラ洞窟は僕が先に踏破してみせる！我が進軍を阻むことは誰にもできぬ！','ぼ、僕の完敗だ。まさか先にモンスターを討伐されるとは……。あなたはすごい冒険者だ。これを受け取ってください！','報告する',1,999,610042,'2010-01-01 00:00:00','2100-01-01 00:00:00',0,0,0,4,1020304,1,210001,2,0),(610044,0,0,5,'レガリア古城突破','ひとりで冒険　神殿の守り神　をクリア','冒険青年サムLv.40','不思議だ……。あなたとは絆のようなものを感じます。レガリア古城、共に突破しましょう。','あなたの背中を追いかけ続けて、僕も大きく成長できました。これは僕の感謝の気持ちです。ぜひ受け取ってください。','報告する',1,999,610043,'2010-01-01 00:00:00','2100-01-01 00:00:00',0,0,0,4,1020404,1,210001,2,0),(610045,0,0,5,'モルス遺跡突破','ひとりで冒険　洞窟の大蛇　をクリア','冒険青年サムLv.45','あなたは何のために冒険をするのですか？モルス遺跡を抜けた先であなたの目的が達成されることを祈っています。共に行きましょう！','あなたの運命は過酷なものなんですね。でも確実に前へ進んでいるあなたを尊敬しています！','報告する',1,999,610044,'2010-01-01 00:00:00','2100-01-01 00:00:00',0,0,0,4,1020504,1,210001,2,0),(610046,0,0,5,'フィニス秘境突破','ひとりで冒険　主、集結　をクリア','冒険青年サムLv.50','あなたの宿命の旅もひと段落しようとしているんですね……。フィニス秘境は険しい土地だと聞いていますが、あなたならきっとすべての運命を越えられます。応援しています！','あなたの旅、見届けさせていただきました。はるかなる旅の先に、あなたは栄光をつかみ取ったのですね……。おめでとうございます！','報告する',1,999,610045,'2010-01-01 00:00:00','2100-01-01 00:00:00',0,0,0,4,1020604,1,210001,2,0),(610047,0,0,5,'仲間と一緒に','みんなで冒険を5回クリアする','傭兵隊長テムジナ','今回もモンスター討伐の募集をさせてもらうよ。ひとりで冒険するよりきっといい報酬が得られるはずだ。特に進化素材はここでしか手に入らないぞ。','たまには知らぬ者と共に冒険するのも悪くはないだろう？これは今回の報酬だ。受け取ってくれたまえ。','討伐報告',1,999,610004,'2010-01-01 00:00:00','2100-01-01 00:00:00',0,0,0,3,99904,5,203001,2,0),(610048,0,0,5,'チームワーク','みんなで冒険を10回クリアする','傭兵隊長テムジナ','また冒険者を集めてモンスター狩りに出ようと思っているんだが、今度も君の力を借りることはできるかな？','ありがとう。君に仕事を頼めば間違いなさそうだな。今回の報酬、受け取ってくれたまえ。','討伐報告',1,999,610047,'2010-01-01 00:00:00','2100-01-01 00:00:00',0,0,0,3,99904,10,203001,2,0),(610049,0,0,5,'みんな友達','みんなで冒険を20回クリアする','傭兵隊長テムジナ','モンスターの討伐は順調なんだが、まだまだ世界にはモンスターがはびこっている。君の力をまた借りたい！','だいぶ他人と冒険に行くことに慣れてきたみたいだな。ぜひこれからも、君には協力をお願いするよ。','討伐報告',1,999,610048,'2010-01-01 00:00:00','2100-01-01 00:00:00',0,0,0,3,99904,20,210001,2,0),(610050,0,0,5,'リーダーシップ','みんなで冒険を30回クリアする','傭兵隊長テムジナ','他の冒険者をまとめる風格が出てきたようだな。リーダーシップをとってモンスターの討伐をしてくれないか？','一人では切り抜けられない戦闘も仲間がいれば心強いだろう。これからも積極的にみんなと冒険に出てみてくれたまえ！','討伐報告',1,999,610049,'2010-01-01 00:00:00','2100-01-01 00:00:00',0,0,0,3,99904,30,210001,2,0),(610051,0,0,5,'うごめく魔物','みんなで冒険を40回クリアする','傭兵隊長テムジナ','最近モンスターの動きが活発になってきているようだ。これまで以上に気を引き締めて討伐をしてもらいたい！','良い成果を出してくれたようだな。君の活躍で仲間たちの士気も上がったようだ。報酬を受け取ってくれたまえ！','討伐報告',1,999,610050,'2010-01-01 00:00:00','2100-01-01 00:00:00',0,0,0,3,99904,40,210001,2,0),(610052,0,0,5,'繋がる絆','みんなで冒険を50回クリアする','傭兵隊長テムジナ','モンスターの勢力が拡大する一方のようだ。このままでは人類は……。いや、君たちの力を信じよう。頼んだぞ！','無事に帰ってきてくれたか。君が戦ってくれたおかげで助かっている人々がいる。ありがとう！','討伐報告',1,999,610051,'2010-01-01 00:00:00','2100-01-01 00:00:00',0,0,0,3,99904,50,210001,2,0),(610053,0,0,5,'百戦錬磨','みんなで冒険を100回クリアする','傭兵隊長テムジナ','厳しい戦いが続いているが、モンスターから人々を守るのが我々の役目だ！頼む、力を貸してくれ！','君の力が確かに世界を平和に導いてくれている。そう感じ始めたよ！','討伐報告',1,999,610052,'2010-01-01 00:00:00','2100-01-01 00:00:00',0,0,0,3,99904,100,210001,3,0),(610054,0,0,5,'平和への道','みんなで冒険を200回クリアする','傭兵隊長テムジナ','これから長い戦いが始まる。人類が勝つかモンスターが勝つか、その戦いを始めよう！','見事な戦いぶりだったぞ！もはや君の力なしには世界に平和はないのかもしれないな。','討伐報告',1,999,610053,'2010-01-01 00:00:00','2100-01-01 00:00:00',0,0,0,3,99904,200,210001,3,0),(610055,0,0,5,'一進一退','みんなで冒険を300回クリアする','傭兵隊長テムジナ','モンスターとの戦いは一進一退だ。どうか君の力で人類に勝利をもたらせてくれ！','モンスターの勢力をだいぶ退けることができたみたいだ！このまま一気に攻め込もう！','討伐報告',1,999,610054,'2010-01-01 00:00:00','2100-01-01 00:00:00',0,0,0,3,99904,300,210001,3,0),(610056,0,0,5,'正念場','みんなで冒険を400回クリアする','傭兵隊長テムジナ','ここが正念場だ！一気に敵を打ち倒して流れをつかもう！','やったぞ！君のおかげでモンスターたちが次々に撤退していく！この戦い、勝てるぞ！','討伐報告',1,999,610055,'2010-01-01 00:00:00','2100-01-01 00:00:00',0,0,0,3,99904,400,210001,3,0),(610057,0,0,5,'伝説のフォルティシア','みんなで冒険を500回クリアする','傭兵隊長テムジナ','長い戦いだった。だが、やまぬ雨はない。人類に栄光をもたらせよう！','勝った……！これでこの辺りもしばらく平和になる。改めて礼を言わせてくれ。本当にありがとう。','討伐報告',1,999,610056,'2010-01-01 00:00:00','2100-01-01 00:00:00',0,0,0,3,99904,500,210001,3,0),(610058,0,0,3,'あふれる倉庫','装備倉庫上限を44枠に拡張する','おせっかいアルナ','家の倉庫が狭く感じたことはあるかのう？倉庫拡張チケットというものを使えば倉庫を広げることができるぞい。','どうやらうまく拡張できたようじゃの。一つ賢くなった記念にこれをあげようかの。','報告する',1,999,610062,'2010-01-01 00:00:00','2100-01-01 00:00:00',0,0,0,1,7,44,203001,2,0),(610060,0,0,5,'アウラ山道中間','ひとりで冒険　集結地点　をクリア','冒険青年サムLv.1','ぼ、ぼぼぼ冒険を始めたはいいけど、も、もも、モンスターが怖くて先に行けないっ。誰かアウラ山道の敵をやっつけてくれないかなぁ……。','ええっ！アウラ山道の敵を退治してくれたの！？あ、ありがとう！これはお礼だよ。受け取ってください！','報告する',1,999,610001,'2010-01-01 00:00:00','2100-01-01 00:00:00',0,0,0,4,1010204,1,210001,2,0),(610061,0,0,1,'常連客になれるかな？','道具を15回生産する','恋するデュラン','だ、だめだ……！ぜんぜん薬屋さんにも魔法屋さんにもお近づきになれない……！た、頼む！俺の代わりに何回も店に通って、うまく店員さんの好きな物を聞き出してくれ！','薬屋さんはケーキ、魔法屋さんはゴーヤが好きだって？ありがとう！これで今度こそ店員さんたちとお近づきになれるぞ！これはお礼だ、ぜひ受け取ってくれ！','教える',1,999,610062,'2010-01-01 00:00:00','2100-01-01 00:00:00',0,0,0,1,135,15,203004,1,0),(610062,0,0,1,'生産できるかな？','道具を5回生産する','恋するデュラン','あんた、薬や魔法アイテムを生産してもらったことはあるかい？実は俺、一度も経験がないんだ……。でもお店のお姉さんにはお近づきになりたいし……。頼む！生産のやり方を俺に教えてくれ！','ありがとう！これで俺も一人で店に行けそうだよ！よーし店員さんと仲良くなるぞ～！これはお礼だ、ぜひ受け取ってくれ！','教える',1,999,610001,'2010-01-01 00:00:00','2100-01-01 00:00:00',0,0,0,1,135,5,203004,1,0),(611000,1000,1,5,'デイリー：みんなで冒険','みんなで冒険を3回クリアする','酒場店主ジョニー','今日来ている依頼だ。こなすかこなさないかはあんた次第だぞ。','やってくれたか。どうもありがとう。これは報酬だ。受け取ってくれ。','報告する',0,999,0,'1970-09-05 09:00:00','2038-09-10 09:00:00',0,1,0,3,99904,3,210001,1,0),(611001,1000,2,1,'デイリー：生産','道具を2回生産する','酒場店主ジョニー','今日来ている依頼だ。こなすかこなさないかはあんた次第だぞ。','やってくれたか。どうもありがとう。これは報酬だ。受け取ってくれ。','報告する',0,999,0,'1970-09-05 09:00:00','2038-09-10 09:00:00',0,1,0,1,135,2,10000,300,0);
