INSERT INTO `quest_cross_link` VALUES (300001,310057,1020105,'オルフェとアーサーのクロスリンク「合戦の地で」が解放されました。「ひとりで冒険」から「ウィリデ森林」エリアを選択するとプレイできます。'),(300002,310058,1020305,'ホックとムータのクロスリンク「ドラゴン退治」が解放されました。「ひとりで冒険」から「ミネラ洞窟」エリアを選択するとプレイできます。'),(300007,300056,1010406,'ドロンとロードのクロスリンク「変わらぬ友情」が解放されました。「ひとりで冒険」から「ルーベル火山」エリアを選択するとプレイできます。'),(300010,310037,1010705,'サリーとゼアスのクロスリンク「兄の威厳」が解放されました。「ひとりで冒険」から「ノヴァ旧跡」エリアを選択するとプレイできます。'),(300017,300049,1010505,'ルイメとハマメイルのクロスリンク「真のフォルティスはどっち」が解放されました。「ひとりで冒険」から「アイテール神殿」エリアを選択するとプレイできます。'),(300038,310001,1020106,'ルコラとティカのクロスリンク「最強のばあちゃん」が解放されました。「ひとりで冒険」から「ウィリデ森林」エリアを選択するとプレイできます。'),(300040,300014,1010306,'フローテとラビータのクロスリンク「守りたい貴方」が解放されました。「ひとりで冒険」から「クラルス湖」エリアを選択するとプレイできます。'),(300055,310025,1010409,'デルフィとバーサのクロスリンク「美しさは永遠？」が解放されました。「ひとりで冒険」から「ルーベル火山」エリアを選択するとプレイできます。'),(300057,320022,1010407,'スロリアとエビネのクロスリンク「アツアツカップル」が解放されました。「ひとりで冒険」から「ルーベル火山」エリアを選択するとプレイできます。'),(300058,300009,1020205,'フーリンとセンカのクロスリンク「思い出の地へ」が解放されました。「ひとりで冒険」から「アルゲオ渓谷」エリアを選択するとプレイできます。'),(300060,320002,1020405,'ナーシーとクフシーのクロスリンク「永遠の愛？」が解放されました。「ひとりで冒険」から「レガリア古城」エリアを選択するとプレイできます。'),(300061,320025,1020505,'ランジとベルのクロスリンク「狂気の男」が解放されました。「ひとりで冒険」から「モルス遺跡」エリアを選択するとプレイできます。'),(310002,310038,1010606,'ナリスとマスカのクロスリンク「おおきな心」が解放されました。「ひとりで冒険」から「ニゲル迷宮」エリアを選択するとプレイできます。'),(310010,320057,1010706,'プルネとミモザのクロスリンク「困ったウワサ好き」が解放されました。「ひとりで冒険」から「ノヴァ旧跡」エリアを選択するとプレイできます。'),(310019,300054,1010605,'カスロとアヤのクロスリンク「究極の忍」が解放されました。「ひとりで冒険」から「ニゲル迷宮」エリアを選択するとプレイできます。'),(310040,320014,1010408,'ジーフィーとキルタのクロスリンク「再会の距離」が解放されました。「ひとりで冒険」から「ルーベル火山」エリアを選択するとプレイできます。'),(320001,300048,1010208,'ミュゲとハシントのクロスリンク「愛の告白」が解放されました。「ひとりで冒険」から「アウラ山道」エリアを選択するとプレイできます。'),(320007,320054,1010209,'ターゲスとネルケのクロスリンク「薬草を探しに」が解放されました。「ひとりで冒険」から「アウラ山道」エリアを選択するとプレイできます。'),(320013,320061,1020605,'ザンカとルドベキアのクロスリンク「真の愛とは？」が解放されました。「ひとりで冒険」から「フィニス秘境」エリアを選択するとプレイできます。'),(320015,300041,1010307,'マルハとブーナのクロスリンク「よぼよぼじいちゃん」が解放されました。「ひとりで冒険」から「クラルス湖」エリアを選択するとプレイできます。'),(320017,300059,1020107,'イデスとコルルのクロスリンク「天才薬師」が解放されました。「ひとりで冒険」から「ウィリデ森林」エリアを選択するとプレイできます。'),(320040,320003,1010210,'ノイミとカントのクロスリンク「「鳥」のいる場所」が解放されました。「ひとりで冒険」から「アウラ山道」エリアを選択するとプレイできます。');
