--
-- Table structure for table `quest_dungeon`
--

DROP TABLE IF EXISTS `quest_dungeon`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `quest_dungeon` (
  `world_id` tinyint(3) unsigned NOT NULL,
  `area_id` tinyint(4) unsigned NOT NULL,
  `id` tinyint(3) unsigned NOT NULL,
  `priority` tinyint(4) DEFAULT '0',
  `title` varchar(255) DEFAULT NULL,
  `enemy_level` int(11) unsigned DEFAULT NULL,
  `party_mode` tinyint(4) unsigned DEFAULT NULL,
  `attribute` tinyint(3) unsigned DEFAULT '6',
  `type` tinyint(3) unsigned DEFAULT '1' COMMENT '1:main\n2:sub\n3:tower',
  `start_type` tinyint(3) unsigned NOT NULL DEFAULT '1' COMMENT '1:開始、招待\n2:開始のみ\n3:招待のみ',
  `file_icon` varchar(255) DEFAULT NULL,
  `try_stp` int(11) unsigned DEFAULT NULL,
  `player_exp` int(11) NOT NULL DEFAULT '0',
  `clear_money` int(10) unsigned NOT NULL DEFAULT '100',
  `kill_border` int(10) unsigned NOT NULL DEFAULT '0',
  `time_border` int(11) unsigned NOT NULL DEFAULT '60',
  `config` int(11) DEFAULT NULL,
  `view_stage` varchar(15) DEFAULT '1',
  `str_message` varchar(255) DEFAULT NULL,
  `str_info` varchar(45) DEFAULT NULL,
  `nb_item` tinyint(3) unsigned DEFAULT NULL,
  `file_item1` varchar(45) DEFAULT NULL,
  `file_item2` varchar(45) DEFAULT NULL,
  `file_item3` varchar(45) DEFAULT NULL,
  `file_item4` varchar(45) DEFAULT NULL,
  `file_item5` varchar(45) DEFAULT NULL,
  `file_item6` varchar(45) DEFAULT NULL,
  `parent_dungeon` varchar(255) DEFAULT NULL,
  `effective_from` datetime DEFAULT '2010-01-01 00:00:00',
  `effective_to` datetime DEFAULT '2050-01-01 00:00:00',
  `open_week` varchar(255) DEFAULT NULL,
  `comp_open1` int(10) unsigned DEFAULT '50',
  `comp_stdid1` int(10) unsigned DEFAULT '10000',
  `comp_num1` int(11) DEFAULT '1',
  `comp_box_type1` int(11) DEFAULT '0' COMMENT '宝箱タイプ',
  `comp_stdid2` int(10) unsigned DEFAULT '10000',
  `comp_num2` int(11) DEFAULT '1',
  `comp_box_type2` int(11) DEFAULT '0' COMMENT '宝箱タイプ',
  `comp_max` int(10) unsigned DEFAULT '1000',
  `limit_lv` int(10) unsigned NOT NULL DEFAULT '0',
  `limit_attr` tinyint(3) unsigned NOT NULL DEFAULT '0',
  `limit_weapon` tinyint(3) unsigned NOT NULL DEFAULT '0',
  PRIMARY KEY (`world_id`,`area_id`,`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;
/*!40101 SET character_set_client = @saved_cs_client */;

--
-- Dumping data for table `quest_dungeon`
--

