/*!40000 ALTER TABLE `quest_dungeon` DISABLE KEYS */;
INSERT INTO `quest_dungeon` VALUES (1,1,1,0,'始まりの場所',1,0,6,1,1,'map_dungeon_icon_pawn_01',4,7,60,5,300,103,'4','カルネの母を探すため、長い冒険が始まった。初めての戦いに勝利しよう。','[ColorWarning]クリア目標：ポーンの討伐',1,'card_s_200034',NULL,NULL,NULL,NULL,NULL,'0','2010-01-01 00:00:00','2050-01-01 00:00:00',NULL,500,350001,1,0,210001,2,0,8000,0,0,0),(1,1,2,1,'魔の住む平原',1,0,6,1,1,'map_dungeon_icon_pawn_01',4,7,60,6,300,104,'2','村の外はモンスターの住む世界。もてる力を最大限に発揮して進もう。','[ColorWarning]クリア目標：ポーンの討伐',2,'card_s_300005','card_s_200034',NULL,NULL,NULL,NULL,'1010101','2010-01-01 00:00:00','2050-01-01 00:00:00',NULL,500,300008,1,0,210001,2,0,8000,0,0,0),(1,1,3,2,'戦いの丘',2,0,6,1,1,'map_dungeon_icon_pawn_01',6,12,90,14,300,106,'4','息つく間もなく押しよせる敵達。道を切り開いて行こう。','[ColorWarning]クリア目標：ポーンの討伐',2,'card_s_300005','card_s_200034',NULL,NULL,NULL,NULL,'1010102','2010-01-01 00:00:00','2050-01-01 00:00:00',NULL,500,203001,3,0,210001,2,0,8000,0,0,0),(1,1,4,3,'はびこる敵',3,0,6,1,1,'map_dungeon_icon_auger_01',6,12,90,18,300,107,'5','生まれ育った村が遠ざかっていく。行く手には多くのモンスター。これから待ち受ける困難に立ち向かう勇気を持たねばならない。','[ColorWarning]クリア目標：オーガの討伐',2,'card_s_300005','card_s_200034',NULL,NULL,NULL,NULL,'1010103','2010-01-01 00:00:00','2050-01-01 00:00:00',NULL,2000,210001,2,0,210001,2,0,8000,0,0,0),(1,1,5,4,'初めての強敵',3,0,6,1,1,'map_dungeon_icon_grandsmasher_01',6,13,90,0,300,226,'2','すっかり村が見えなくなり、未知の世界へ踏み入れる。その時、目の前に巨大な敵が立ちはだかった。','[ColorWarning]クリア目標：グランドスマッシャーの討伐',2,'card_s_300005','card_s_200034',NULL,NULL,NULL,NULL,'1010104','2010-01-01 00:00:00','2050-01-01 00:00:00',NULL,2000,210001,2,0,210001,2,0,8000,0,0,0),(1,2,1,0,'限りなき山路',3,0,3,1,1,'map_dungeon_icon_wolf_01',6,12,90,19,300,189,'5','狭い山道を行くと、立ち尽くす男の姿があった。何やら困っているようだ。','[ColorWarning]クリア目標：ウルフの討伐',2,'card_s_310030','card_s_200034',NULL,NULL,NULL,NULL,'1010105','2010-01-01 00:00:00','2050-01-01 00:00:00',NULL,3150,210001,1,0,210001,2,0,8000,0,0,0),(1,2,2,1,'行く手を阻む者たち',3,0,3,1,1,'map_dungeon_icon_aerostinger_01',6,12,90,9,300,108,'3','はぐれた商隊を探してさらに進む。次々と襲いかかるモンスターを殲滅しよう。','[ColorWarning]クリア目標：エアロスティンガーの討伐',2,'card_s_310030','card_s_200034',NULL,NULL,NULL,NULL,'1010201','2010-01-01 00:00:00','2050-01-01 00:00:00',NULL,3150,210001,1,0,210001,2,0,8000,0,0,0),(1,2,3,2,'塞がれた進路',3,0,3,1,1,'map_dungeon_icon_auger_01',6,12,90,17,300,191,'6','進路を阻むように現れる敵。苦しい捜索はまだ続きそうだ。','[ColorWarning]クリア目標：オーガの討伐',2,'card_s_310030','card_s_200034',NULL,NULL,NULL,NULL,'1010202','2010-01-01 00:00:00','2050-01-01 00:00:00',NULL,3150,210001,1,0,210001,2,0,8000,0,0,0),(1,2,4,3,'集結地点',3,0,3,1,1,'map_dungeon_icon_auger_01',7,14,105,27,300,218,'2','開けた土地にモンスターの大群が待ち構えていた。どうやらモンスターの足を踏み入れてしまったらしい。','[ColorWarning]クリア目標：オーガの討伐',3,'card_s_310030','card_s_370030','card_s_200034',NULL,NULL,NULL,'1010203','2010-01-01 00:00:00','2050-01-01 00:00:00',NULL,3150,210001,1,0,210001,2,0,8000,0,0,0),(1,2,5,4,'罠',3,0,3,1,1,'map_dungeon_icon_auger_01',7,14,105,21,300,219,'4','この辺りには宝をエサに人間をおびきよせるモンスター達がいるらしい。気を付けて進もう。','[ColorWarning]クリア目標：オーガの討伐',3,'card_s_310030','card_s_370027','card_s_200034',NULL,NULL,NULL,'1010204','2010-01-01 00:00:00','2050-01-01 00:00:00',NULL,3150,210001,1,0,210001,2,0,8000,0,0,0),(1,2,6,5,'丘の上の砦',3,0,3,1,1,'map_dungeon_icon_auger_01',7,14,105,19,300,220,'5','山道も終わりの方に近づいた。そろそろ商隊の姿が見えても良いころなのだが……','[ColorWarning]クリア目標：オーガの討伐',3,'card_s_310030','card_s_360014','card_s_200034',NULL,NULL,NULL,'1010205','2010-01-01 00:00:00','2050-01-01 00:00:00',NULL,3150,210001,1,0,210001,2,0,8000,0,0,0),(1,2,7,6,'風に育まれし者',4,0,3,1,1,'map_dungeon_icon_trent_01',7,16,105,12,300,109,'4','商隊の人達の叫び声が聞こえた。強大なモンスターが現れたのかもしれない。','[ColorWarning]クリア目標：トレントの討伐',3,'card_s_310030','card_s_370027','card_s_200034',NULL,NULL,NULL,'1010206','2010-01-01 00:00:00','2050-01-01 00:00:00',NULL,500,310030,1,0,210001,2,0,9000,0,0,0),(1,2,8,7,'愛の告白',3,0,3,2,1,'map_dungeon_icon_wildtree_01',12,28,280,18,300,155,'5','仲の良い夫婦のハシントとミュゲ。ハシントはミュゲに伝えたい言葉があるらしく、とある場所へと向かうことになる。','[ColorWarning]クリア目標：ワイルドツリーの討伐',2,'card_s_310030','card_s_200034',NULL,NULL,NULL,NULL,NULL,'2010-01-01 00:00:00','2050-01-01 00:00:00',NULL,8400,210001,2,0,210001,2,0,16800,0,0,0),(1,2,9,8,'薬草を探しに',3,0,3,2,1,'map_dungeon_icon_wildtree_01',12,28,280,16,300,157,'8','天才医術師であったターゲスと、その弟子のネルケ。病に苦しむ師を救えなかったことを、悔やみ続けていたネルケ。だが、ついに……','[ColorWarning]クリア目標：ワイルドツリーの討伐',2,'card_s_310030','card_s_200034',NULL,NULL,NULL,NULL,NULL,'2010-01-01 00:00:00','2050-01-01 00:00:00',NULL,8400,210001,2,0,210001,2,0,16800,0,0,0),(1,2,10,9,'「鳥」のいる場所',3,0,3,2,1,'map_dungeon_icon_moshobo_01',12,28,280,28,300,170,'7','外になかなか出られないカントにいつも幸せを運んでいた郵便屋さんのノイミ。最後に教えてくれた「鳥」のいる場所へ……','[ColorWarning]クリア目標：モーショボーの討伐',2,'card_s_310030','card_s_200034',NULL,NULL,NULL,NULL,NULL,'2010-01-01 00:00:00','2050-01-01 00:00:00',NULL,8400,210001,2,0,210001,2,0,16800,0,0,0),(1,3,1,0,'泉の宮殿',3,0,2,1,1,'map_dungeon_icon_attacker_01',8,16,120,12,300,110,'3','商隊長から聞いたフォルティシアを追ってたどり着いたのは湖に囲まれた宮殿だった。ここに目的の人物がいるかもしれない。','[ColorWarning]クリア目標：アタッカーの討伐',3,'card_s_320010','card_s_370019','card_s_200034',NULL,NULL,NULL,'1010207','2010-01-01 00:00:00','2050-01-01 00:00:00',NULL,3360,210001,1,0,210001,2,0,9000,0,0,0),(1,3,2,1,'宮殿の奥へ',4,0,2,1,1,'map_dungeon_icon_nymph_01',8,16,120,19,300,111,'5','水の力を持つモンスター達が次々と現れる。敵の攻撃に気を付けながら進もう。','[ColorWarning]クリア目標：ニンフの討伐',3,'card_s_320010','card_s_360011','card_s_200034',NULL,NULL,NULL,'1010301','2010-01-01 00:00:00','2050-01-01 00:00:00',NULL,3360,210001,1,0,210001,2,0,9000,0,0,0),(1,3,3,2,'襲い来る波',4,0,2,1,1,'map_dungeon_icon_attacker_01',8,16,120,18,300,192,'3','押し寄せる波のごとき敵の猛攻は、徐々に激しさを増していく。力を振り絞り、何とか切り抜けよう。','[ColorWarning]クリア目標：アタッカーの討伐',3,'card_s_320010','card_s_370021','card_s_200034',NULL,NULL,NULL,'1010302','2010-01-01 00:00:00','2050-01-01 00:00:00',NULL,3360,210001,1,0,210001,2,0,10080,0,0,0),(1,3,4,3,'青の群集',4,0,2,1,1,'map_dungeon_icon_augustine_01',8,16,120,17,300,112,'5','行く手には敵の集団が待ち受けていた。数に押されないように注意して進もう。','[ColorWarning]クリア目標：オーガスの討伐',3,'card_s_320010','card_s_370019','card_s_200034',NULL,NULL,NULL,'1010303','2010-01-01 00:00:00','2050-01-01 00:00:00',NULL,3360,210001,1,0,210001,2,0,10080,0,0,0),(1,3,5,4,'水の流れの如く',5,0,2,1,1,'map_dungeon_icon_lcicle_01',8,18,120,7,300,113,'4','強い敵の気配を感じる。宮殿の最奥で待ち構えるものはいったい何なのだろうか。','[ColorWarning]クリア目標：アイシクルの討伐',3,'card_s_320010','card_s_370021','card_s_200034',NULL,NULL,NULL,'1010304','2010-01-01 00:00:00','2050-01-01 00:00:00',NULL,500,320010,1,0,210001,2,0,10920,0,0,0),(1,3,6,5,'守りたい貴方',4,0,2,2,1,'map_dungeon_icon_augustine_01',12,28,280,17,300,164,'5','弱かったフローテをいつも守っていたラビータ。そんなラビータに憧れ、剣霊になった彼女とラビータの思いとは……','[ColorWarning]クリア目標：オーガスの討伐',2,'card_s_320010','card_s_200034',NULL,NULL,NULL,NULL,NULL,'2010-01-01 00:00:00','2050-01-01 00:00:00',NULL,8400,210001,2,0,210001,2,0,16800,0,0,0),(1,3,7,6,'よぼよぼじいちゃん',4,0,2,2,1,'map_dungeon_icon_augustine_01',12,28,280,22,300,172,'6','久々に会った孫・ブーナの顔と名前を全く覚えていないマルハおじいちゃん。宝物を見つけたというマルハに一同付いていってみると……','[ColorWarning]クリア目標：オーガスの討伐',2,'card_s_320010','card_s_200034',NULL,NULL,NULL,NULL,NULL,'2010-01-01 00:00:00','2050-01-01 00:00:00',NULL,8400,210001,2,0,210001,2,0,16800,0,0,0),(1,4,1,0,'灼熱の大地',3,0,1,1,1,'map_dungeon_icon_zoradourufu_01',10,20,150,12,300,114,'4','フォルティシアを追ってさらに進むと、次に見えてきたのは巨大な火山であった。','[ColorWarning]クリア目標：ゾラドウルフの討伐',3,'card_s_310023','card_s_370013','card_s_200034',NULL,NULL,NULL,'1010305','2010-01-01 00:00:00','2050-01-01 00:00:00',NULL,5040,210001,1,0,210001,2,0,13440,0,0,0),(1,4,2,1,'暑さに負けるな',4,0,1,1,1,'map_dungeon_icon_slicer_01',10,20,150,16,300,115,'5','突如、猛烈な熱気に襲われた。防火対策をしなければ身を焦がされてしまいそうだ。','[ColorWarning]クリア目標：スライサーの討伐',3,'card_s_310023','card_s_370015','card_s_200034',NULL,NULL,NULL,'1010401','2010-01-01 00:00:00','2050-01-01 00:00:00',NULL,5040,210001,1,0,210001,2,0,15120,0,0,0),(1,4,3,2,'火の玉とトゲ',5,0,1,1,1,'map_dungeon_icon_torch_01',10,20,150,16,300,190,'5','火山を抜けるには奥へと進まなねばならない。モンスターに気を付けながら深い地下を進もう。','[ColorWarning]クリア目標：トーチの討伐',3,'card_s_310023','card_s_360008','card_s_200034',NULL,NULL,NULL,'1010402','2010-01-01 00:00:00','2050-01-01 00:00:00',NULL,6720,210001,1,0,210001,2,0,17640,0,0,0),(1,4,4,3,'煮えたぎるマグマ',5,0,1,1,1,'map_dungeon_icon_slicer_01',10,20,150,18,300,116,'3','溶岩を横目に険しい山を踏破していく。猛火のように迫りくるモンスターを撃退しながら進もう。'